(40, 9, 'Ранний въезд (до 14:00) и поздний выезд (после 12:00) оплачиваются как 50% суточного проживания.', 'Early checking in (till 2.00 p.m.) and late checking out (after 12.00 noon) are charged 50 % of daily rate.', 1, 1, 0, '2012-12-07 13:32:23', 'Früh. Anreise (vor 14:00 Uhr) und spät. Abreise (nach 12:00 Uhr) werden mit 50% 50% des Tagessatzes berechnet.'),
