(44, 10, 'Смена белья и полотенец включена в стоимость: Раз в четыре дня.', 'Change of linen and towels is included in price: Once in four days.', 2, 1, 0, '2012-12-07 12:57:47', 'Wechsel der Bettwäsche und Handtücher ist im Preis inbegriffen: Einmal in vier Tagen.'),
(45, 10, 'Цены указаны в рублях РФ. Текущий курс обмена валют вы можете посмотреть на сайте ЦБ РФ.', 'The prices are specified in USD. You can find the current rate of a currency exchange on the site of the Central Bank of the Russian Federation.', 3, 1, 1, '2012-12-07 13:21:31', 'Die Preise werden in USD angegeben. Aktuelle Wechselkurse für Währungen können Sie auf der Website der Zentralbank der Russischen Föderation finden.');
