INSERT INTO `{dbPrefix}articles` (`id`, `page_title_ru`, `page_body_ru`, `date_updated`, `active`, `sorter`, `page_title_en`, `page_body_en`, `page_title_de`, `page_body_de`) VALUES
(5, 'Лучшие города для холостяков', '<p>\r\n	Итак, Вы устали знакомиться на улицах и в барах своего города в попытках найти того или ту единственную, или может быть, у Вас было достаточно неудач на первых свиданиях, и поэтому Вас не заставишь выйти из дома в субботу вечером. Не отчаивайтесь. &quot;Форбс&quot; составил список лучших городов для холостяков и незамужних девушек, изучив такие факторы как &quot;потрясность&quot;, число холостяков и незамужних девушек, ночная жизнь и рост числа рабочих мест, и они полностью подходят следующим&nbsp; топ-5 городов для знакомств:</p>\r\n<p>\r\n	1.Нью-Йорк<br />\r\n	2.Бостон<br />\r\n	3.Чикаго<br />\r\n	4.Сиэтл<br />\r\n	5.Вашингтон, округ Колумбия</p>\r\n', '2013-02-18 04:03:42', 1, 1, 'Best Places for Singles', '<p>\r\n	So you&#39;re tired of combing the streets and bars of your city in an attempt to find that special someone, or maybe you&#39;ve had enough bad first dates to keep you in on a Saturday night. Don&#39;t despair. The folks at Forbes&#39;s have compiled stats, looking at factors like &quot;coolness&quot;, number of singles, nightlife and job growth to come up with these top five dating cities.</p>\r\n<p>\r\n	1. New York<br />\r\n	2. Boston<br />\r\n	3. Chicago<br />\r\n	4. Seattle<br />\r\n	5. Washington D.C.</p>\r\n', 'Die besten Städte für die Ledigen', '<p>\r\n	<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	-->	</style>\r\n</p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	-->	</style>\r\n</p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">Also sind Sie m&uuml;de, die Stra&szlig;en und Bars Ihrer Stadt zu wechseln, um den einzigen oder die einzige zu finden, oder vielleicht haben Sie schon genug schlechte ersten Treffe, und also gehen Sie auf die Stra&szlig;e am Samstagabend niсht hinaus. Verzweifeln Sie nicht. </span><span lang="de-DE"><span style="font-weight: normal">&#39;Forbes&#39; hat die Liste von </span></span><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">besten </span></span></span><em><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">St&auml;dten </span></span></span></em><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">f&uuml;r die Ledigen</span></span></span><span lang="de-DE"><span style="font-weight: normal"> zus</span></span><span lang="de-DE">ammengestellt, man hat solche Faktoren wie &#39;Coolness&#39;, die Zahl der </span><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">Ledigen</span></span></span><span lang="de-DE">, Nachtleben und Besch&auml;ftigungswachstum gepr&uuml;ft, das Resultat ist diese f&uuml;nf Dating-St&auml;dte.</span></p>\r\n<p>\r\n	<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	-->	</style>\r\n</p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">1. New York<br />\r\n	2. Boston<br />\r\n	3. Chicago<br />\r\n	4. Seattle<br />\r\n	5. Washington D.C.</span></p>\r\n'),
(6, 'Наилучшие города для семьи', '<p>\r\n	Детский журнал провел обширное исследование среди 100 городов США в поисках лучших из них для того, чтобы растить детей. Учитывались такие факторы как, детское здравоохранение, школы, плата за жилье, качество воздуха.</p>\r\n<p>\r\n	1.Денвер, штат Колорадо<br />\r\n	2.Норфолк/Вирджиния-Бич/Ньюпорт-Ньюс, штат Виргиния<br />\r\n	3.Миннеаполис/Сент-Пол, штат Миннесота<br />\r\n	4.Майами, штат Флорида<br />\r\n	5.Орландо, штат Флорида</p>\r\n', '2013-02-18 04:04:40', 1, 2, 'Best Places for Families', '<p>\r\n	Child magazine conducted an extensive search of 100 cities throughout the US to find the best place to raise a family. Factors ranged from pediatric healthcare, schools, housing costs and air quality.</p>\r\n<p>\r\n	1. Denver, Colorado<br />\r\n	2. Norfolk/Virginia Beach/Newport News, Virginia<br />\r\n	3. Minneapolis/St.Paul, Minnesota<br />\r\n	4. Miami, Florida<br />\r\n	5. Orlando, Florida</p>\r\n', 'Die besten Städte für Familien', '<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	--></style>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">Eine Kinder-</span>Zeitschrift<span lang="de-DE"> f&uuml;hrte eine umfassende Suche nach 100 St&auml;dten in den USA durch, um die beste Stadt zur eine Familie-Gr&uuml;ndung zu finden. Es reichten solche Faktoren, wie p&auml;diatrische Gesundheitsversorgung, Schulen, Wohnkosten und Luftqualit&auml;t.</span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<br />\r\n	<span lang="de-DE">1. Denver, Colorado<br />\r\n	2. Norfolk / Virginia Beach / Newport News, Virginia<br />\r\n	3. Minneapolis / St.Paul, Minnesota<br />\r\n	4. Miami, Florida<br />\r\n	5. Orlando, Florida</span></p>\r\n');
