(1,	1,	'apartments',	1,	'{\"type\":\"0\",\"obj_type_id\":\"0\"}',	1,	'Добро пожаловать!',	'Welcome!',	'Herzlich Willkommen!',	'2014-02-20 00:00:00',	'2014-04-14 12:56:58',	'<p>\r\n	<strong>Open Real Estate</strong> предоставляет возможность агентствам недвижимости и риэлторам успешно взаимодействовать как с владельцами недвижимости, так и с потенциальными покупателями и интернет-пользователями.<br />\r\n	<br />\r\n	Согласно Вашим запросам, мы можем добавить или удалить отдельные функции продукта и развивать их таким образом, чтобы Ваш web-сайт максимально соответствовал запросам и идеям Вашего бизнеса.<br />\r\n	<br />\r\n	Мы, <a href=\"http://monoray.ru\">студия Monoray</a>, стремимся делать сайты, которые максимально просты в использовании как для администраторов, так и для обычных пользователей интернета. Это касается не только Open Real Estate, но и любых сайтов. Мы можем создавать web-сайты различной сложности с &quot;нуля&quot;.<br />\r\n	<br />\r\n	<strong>С нами Ваши бизнес-идеи станут реальностью!</strong></p>\r\n',	'<p>\r\n	<strong>Open Real Estate</strong> offers real estate agencies and realtors the technology they need to connect with today&rsquo;s real estate owners, prospective buyers and tenants and Internet surfers.<br />\r\n	<br />\r\n	According to your wish we can add, remove product&#39;s features and develop them in such a way that your web site captures the essence of Your Business.<br />\r\n	<br />\r\n	At <a href=\"http://monoray.net\">MonoRay Studio</a> our goal is to produce websites that are search-engine friendly and refreshingly easy-to-use for admin and for users. It concerns not only а website for real estate agencies or for realtors, but any website. We build websites from the ground as well. Project managers work with you until you are satisfied with a site that meets your expectations the best way.<br />\r\n	<br />\r\n	<strong>Let Your Business Ideas Come True!</strong></p>\r\n',	'<style type=\"text/css\">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in }\r\n		A:link { so-language: zxx }\r\n	--></style>\r\n<p style=\"margin-bottom: 0in\">\r\n	<strong><span lang=\"de-DE\">Open Real Estate</span></strong><span lang=\"de-DE\"> b</span><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\">ietet Immobilienagenturen und Agenten die M&ouml;glichkeit, erfolgreich </span></span></span><strong><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\">sowohl mit</span></span></span></strong><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\"> Eigent&uuml;mern als auch mit potenziellen K&auml;ufern und Internetnutzern </span></span></span><span style=\"font-style: normal\"><span style=\"font-weight: normal\">zusammenzuarbeiten</span></span><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\">.<br />\r\n	Wir k&ouml;nnen nach Ihren W&uuml;nschen einzelne Funktionen des Produkts hinzuf&uuml;gen oder entfernen und sie so entwickeln, dass Ihre Websi</span></span></span><span lang=\"de-DE\">te Ihren Bed&uuml;rfnissen und Ideen von Ihrem </span>Business <span lang=\"de-DE\">am besten</span> <span lang=\"de-DE\">entsprechen wird.</span><br />\r\n	<span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\">Wir, das <a href=\"http://monoray.net\">Monoray Studio</a>, sind bestrebt, solche Websites zu entwickeln, deren Verwaltung</span></span></span><strong><span style=\"font-style: normal\"><span style=\"font-weight: normal\"> </span></span></strong><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\">f&uuml;r Administratoren und</span></span></span><strong><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\"> </span></span></span></strong><span lang=\"de-DE\"><span style=\"font-style: normal\"><span style=\"font-weight: normal\">Benutzer einfach ist. </span></span></span><span lang=\"de-DE\">Dies betrifft nicht nur Open Real Estate, sondern auch andere Websites. Wir k&ouml;nnen Websites vom unterschiedlichen </span>Schwierigkeitsgrad<span lang=\"de-DE\"> von Grund auf erstellen.</span></p>\r\n<p style=\"margin-bottom: 0in\">\r\n	<strong><span lang=\"de-DE\">Lassen Sie uns Ihre Business-Ideen r</span>ealisieren<span lang=\"de-DE\">!</span></strong></p>\r\n'),
