INSERT INTO `{dbPrefix}news` (`id`, `image_id`, `title_ru`, `body_ru`, `date_created`, `date_updated`, `body_en`, `title_en`, `title_de`, `body_de`, `announce_ru`, `announce_en`, `announce_de`) VALUES
(13, 0, 'Какие вещи во время переезда ломаются чаще всего?', '<p>\r\n	При переезде в новый дом или квартиру, имейте ввиду: некоторые вещи сделаны, чтобы сломаться. Когда дело доходит до переезда, нужно быть осторожным.</p>\r\n<p>\r\n	<br />\r\n	Какие вещи чаще всего могут сломаться или разбиться при переезде?<br />\r\n	<br />\r\n	<strong>#1 &ndash; Электронная техника</strong><br />\r\n	Компьютеры, телевизоры, а также домашние кинотеатры зачастую становятся жертвами поломки, когда наступает время переезда. Если уронить электронику, то ее чувствительные и хрупкие компоненты могут получить серьезные повреждения<br />\r\n	Возможное решение? Сохраняйте коробки и упаковочные материалы, которые изначально шли вместе с вещами. Когда придет время перевезти их в новый дом, уложите гаджеты в упаковки и коробки так, как было при покупке.<br />\r\n	<br />\r\n	<strong>#2 &ndash; Cпина</strong><br />\r\n	Боль в спине, растянутые мышцы, переломы костей -&nbsp; физические травмы, получаемые при попытке передвинуть тот же холодильник или фортепиано, не имея специального оборудования или силы нескольких человек.<br />\r\n	Используйте прицеп для более крупной мебели, и заранее детально изучить маршрут передвижения.<br />\r\n	<br />\r\n	<strong>#3 &mdash; Зеркала</strong><br />\r\n	Семь лет неудач грозит тому, кто попытается перевозить зеркала самостоятельно. Это хрупкая вещь.<br />\r\n	Зеркала подвержены битью еще и потому, что их рамки не могут выдержать силы удара при падении или надавливании. Поэтому не спите на подушках, когда переезжаете &mdash; обкладывайте ими зеркала и другие хрупкие вещи! В любом случае их нужно упаковывать.<br />\r\n	<br />\r\n	<strong>#4 &mdash; Дом</strong><br />\r\n	Дверные косяки, стены и полы подвержены ударам и царапинам при перемещении крупных предметов мебели.<br />\r\n	Если вы не хотите оставить царапины в старом или новом жилище, есть один надежный способ - нанять опытных грузчиков.<br />\r\n	<br />\r\n	<strong>#5 - Изделия из стекла /фарфора</strong><br />\r\n	Изделия из стекла, фарфора, а также посуда являются одними из самых легко бьющихся во время переезда. Эти штучные изделия чрезвычайно хрупки и могут расколоться, если их упаковывать, как селедку в бочке.<br />\r\n	Поэтому используйте бумагу и пузырчатую пленку и оставляйте пространство между ними и коробкой.<br />\r\n	<br />\r\n	<strong>#6 &mdash; Рамочные картины</strong><br />\r\n	Во время переезда картины и другие произведения искусства подвержены самым разным повреждениям, если рядом с ними положить или упаковать предметы с острыми краями.<br />\r\n	Во многих случаях рамки богато украшенные, дорогие, и легко трескаются. Пытаясь плотно упаковать в машину вещи, люди ставят на картины ящики. Если так делать, то можно легко их продырявить.</p>\r\n', '2015-07-01 14:53:06', '2015-07-01 04:36:05', '<p>\r\n	If you&#39;re moving to a new house or apartment, be advised: Some things are made to be broken.<br />\r\n	When it comes to moving, you&#39;ve got to be careful.<br />\r\n	<br />\r\n	Which items are among the most likely to get smashed and dashed at moving time?<br />\r\n	<br />\r\n	<strong>#1 - Electronics</strong><br />\r\n	Computers, TVs, and home entertainment systems are among the most likely victims of breakage when it comes time to move. If you drop electronics, the sensitive and delicate components can suffer major damage.<br />\r\n	A possible solution? Save the boxes and packing materials that originally came with the items. When the time comes to transport the gear to your next home, re-pack your gadgets in the boxes and materials the way you purchased them.<br />\r\n	<br />\r\n	<strong>#2 - Your Back</strong><br />\r\n	Back pain, pulled muscles, and broken bones are among the physical injuries you can suffer by trying to move that refrigerator or piano without the right equipment or people power.<br />\r\n	Use a cart for larger pieces and go over the moving route in advance.<br />\r\n	<br />\r\n	<strong>#3 - Mirrors</strong><br />\r\n	Seven years of bad luck might be in your future if you try to move mirrors yourself. It is a fragile item.<br />\r\n	Mirrors also can be prone to breakage because the frames holding them can&#39;t withstand the force of being dropped or jostled. So don&#39;t sleep on your pillows when you&#39;re moving - use them as cushions for mirrors and other fragile times! You&#39;ve got to pack them anyway.<br />\r\n	<br />\r\n	<strong>#4 - The House</strong><br />\r\n	Door jambs, walls, and floors are prone to getting hit and scraped when moving larger items.<br />\r\n	If you&#39;re worried about leaving any scratches on your old or new abode, one smart option might be to hire some experienced movers.<br />\r\n	<br />\r\n	<strong>#5 - Glassware/China</strong><br />\r\n	Glassware, China, and dishes are among the most easily broken items during a move. These pieces are extremely fragile and can shatter when they&#39;re packed together like sardines.<br />\r\n	So use paper and bubble wrap and leave space between them and the box.<br />\r\n	<br />\r\n	<strong>#6 - Framed Artwork</strong><br />\r\n	Paintings and artwork are subject to various kinds of damage during moves if you drop them or pack them next to objects with sharp edges.<br />\r\n	Very many times, frames are very ornate, expensive, and easy to crack. People try to pack things tight in a truck and they put boxes on top of paintings. If you do that, it&#39;s easy to put holes in them.</p>\r\n', 'Which items often get broken during a move?', 'Welche Gegenstände oft bei einem Umzug kaputt gehen?', '<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">Wenn Sie in ein neues Haus oder eine Wohnung </span>umziehen<span lang="de-DE">, wissen Sie: manche Dinge sind da, um gebrochen zu werden.<br />\r\n	Wenn es um eine</span><span lang="de-DE"><span style="font-weight: normal">n Umzug </span></span><span lang="de-DE">geht, m&uuml;ssen Sie vorsichtig sein.</span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<br />\r\n	<span lang="de-DE">Welche</span><span lang="de-DE"><span style="font-weight: normal"> Gegenst&auml;nde </span></span><span lang="de-DE">geh&ouml;ren zu den</span><span lang="de-DE">en, die</span><span lang="de-DE"><span style="font-weight: normal"> oft bei </span></span><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">Um</span></span></span><em><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">z&uuml;ge </span></span></span></em><span lang="de-DE"><span style="font-weight: normal">kaputt gehen </span></span><span lang="de-DE">oder gebrochen werden</span><span lang="de-DE"><span style="font-style: normal">?</span></span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE"><span style="font-style: normal"><b># 1 - </b></span></span><em><span style="font-style: normal"><b>Elektronikger&auml;te</b></span></em><br />\r\n	<span lang="de-DE">Computer, Fernseher und Home Entertainment Systeme geh&ouml;ren zu den m&ouml;glichen Opfern vom Bruch, wenn die Zeit vom Umzug kommt. Wenn Sie Elektr</span><span lang="de-DE"><span style="font-weight: normal">onik</span></span><em><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">ger&auml;te</span></span></span></em><span lang="de-DE"><span style="font-weight: normal"> fallen l</span></span><span lang="de-DE">assen, k&ouml;nnen die sensible und empfindliche Bauteile gro&szlig;en Sch&auml;den leiden.<br />\r\n	Eine m&ouml;gliche L&ouml;sung? Bewahren Sie die Kartons und Materialien, in denen die G</span><em><span lang="de-DE"><span style="font-style: normal"><span style="font-weight: normal">er&auml;te</span></span></span></em><span lang="de-DE"> urspr&uuml;nglich verpackt sind. Wenn die Zeit kommt, sie zu Ihrem neuen Haus zu transportieren, verpacken Sie Ihre Gadgets in den Materialien und Kartons auf solche Weise, wie Sie sie gekauft haben.</span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	&nbsp;<span lang="de-DE"><b># 2 &ndash; Ihr </b></span><b>R&uuml;cken</b><br />\r\n	<span lang="de-DE">R&uuml;ckenschmerzen, Zerrungen und Knochenbr&uuml;che geh&ouml;ren zu den k&ouml;rperlichen Verletzungen, die Sie bekomme</span><span lang="de-DE"><span style="font-style: normal">n </span></span><em><span lang="de-DE"><span style="font-style: normal">k&ouml;nnen</span></span></em><span lang="de-DE"><span style="font-style: normal">,</span></span><span lang="de-DE"> indem Sie versuchen, diesen K&uuml;hlschrank oder Klavier ohne die richtige Ausr&uuml;stung oder die Macht zu bewegen.<br />\r\n	Verwenden Sie einen Wagen f&uuml;r gr&ouml;&szlig;ere St&uuml;cke und gehen &uuml;ber die bewegende Route im Voraus.</span><br />\r\n	<br />\r\n	<span lang="de-DE"><b># 3 - Spiegel</b></span><br />\r\n	<span lang="de-DE"><span style="font-style: normal">7 </span></span><em><span lang="de-DE"><span style="font-style: normal">Jahre Pech</span></span></em><span lang="de-DE"><span style="font-style: normal"> haben Sie, wenn ein Spiegel zerbrochen wird</span></span><span lang="de-DE">, als Sie versuchen, ihn selbst zu transportieren. Er ist eine fragile Sache</span><span lang="de-DE"><span style="font-weight: normal">.</span></span><br />\r\n	<span lang="de-DE">Spiegel sind besonders </span><span lang="de-DE">f&uuml;r Bruch </span><span lang="de-DE">anf&auml;llig, weil seine Rahmen die Schlagkraft durch Fallenlassen oder Dr&uuml;cken nicht halte</span><span lang="de-DE"><span style="font-style: normal">n </span></span><em><span lang="de-DE"><span style="font-style: normal">k&ouml;nnen</span></span></em><span lang="de-DE"><span style="font-style: normal">. </span></span><span lang="de-DE">Also schlafen Sie nicht auf Kopfkissen, wenn Sie umziehen - nutzen Sie sie f&uuml;r Zudecken von Spiegeln und andere fragile Sachen! In jedem Fall m&uuml;ssen sie verpackt werden.</span><br />\r\n	<br />\r\n	<span lang="de-DE"><b># 4 &ndash; Das Haus</b></span><br />\r\n	<span lang="de-DE">T&uuml;rpfosten, W&auml;nde und B&ouml;den sind immer beim Bewegen von gr&ouml;&szlig;eren Gegenst&auml;nden geschlagen und gekratzt .<br />\r\n	Wenn Sie keine Kratzer in Ihrer alten oder neuen Wohnung hinterlasen wollen, gibt es eine zuverl&auml;ssige L&ouml;sung: stellen Sie erfahrene </span><font color="#000000"><span lang="de-DE">M&ouml;belr&auml;umer an</span></font><span lang="de-DE">.</span><br />\r\n	<br />\r\n	<span lang="de-DE"><b># 5 - Glaswaren / Porzellan</b></span><br />\r\n	<span lang="de-DE">Glasware</span><span lang="de-DE"><span style="font-weight: normal">n, Porzellan un</span></span><span lang="de-DE">d Geschirr geh&ouml;ren zu den leicht gebrochen w&auml;hrend des Umzugs Gegenst&auml;nden. Diese St&uuml;cke sind &auml;u&szlig;erst fragil und </span><em><span lang="de-DE"><span style="font-style: normal">k&ouml;nnen</span></span></em><span lang="de-DE"> zerbrechen, wenn sie wie Hering in einem Fass verpackt sind.<br />\r\n	So benutzen Sie Papier und Luftpolsterfolie und lassen Raum zwischen ihnen und dem Karton.</span><br />\r\n	<br />\r\n	<span lang="de-DE"><b># 6 &ndash; Gem&auml;lde</b></span><br />\r\n	<span lang="de-DE">Gem&auml;lde und andere Kunstwerke sind</span><span lang="de-DE"> </span><span lang="de-DE">f&uuml;r </span><span lang="de-DE">verschiedene Arten von Sch&auml;den bei Umz&uuml;gen </span><span lang="de-DE">anf&auml;llig</span><span lang="de-DE">, wenn man sie fallen l&auml;sst oder sie neben den Objekten mit scharfen Kanten packt.</span><br />\r\n	<span lang="de-DE">Oft sind die Rahmen sehr reich verzierten, teuer und leicht zu knacken. Man versucht, die Dinge fest in einem LKW zu packen und setzt K&auml;stchen auf die </span><span lang="de-DE">Gem&auml;lde. </span><span lang="de-DE">Wenn Sie es tun, ist es einfach, L&ouml;cher in ihnen zu setzen.</span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	&nbsp;</p>\r\n', '<p>\r\n	При переезде в новый дом или квартиру, имейте ввиду: некоторые вещи сделаны, чтобы сломаться. Когда дело доходит до переезда, нужно быть осторожным.</p>\r\n', '<p>\r\n	If you&#39;re moving to a new house or apartment, be advised: Some things are made to be broken.</p>\r\n', '<p>\r\n	<span lang="de-DE">Wenn Sie in ein neues Haus oder eine Wohnung&nbsp;</span>umziehen<span lang="de-DE">, wissen Sie: manche Dinge sind da, um gebrochen zu werden.<br />\r\n	Wenn es um eine</span><span lang="de-DE">n Umzug&nbsp;</span><span lang="de-DE">geht, m&uuml;ssen Sie vorsichtig sein.</span></p>\r\n'),
(14, 1, 'Наилучшие для проживания города', '<p>\r\n	Чтобы найти наилучшие для проживания города, требуется провести небольшое исследование. Cобрав все данные и проведя опросы c этой целью, многие компании и организации проделали за вас большую работу.<br />\r\n	<br />\r\n	<strong>Наилучшие для проживания города мира</strong><br />\r\n	Находящаяся в Лондоне Консалтинговая группа Economist Intelligence Unit (EIU) составила список городов мира, наилучших для проживания и посещения.<br />\r\n	<br />\r\n	Изучив 40 различных показатеоей, разделенных по 5 отдельным категориям, включая стабильность, здравоохранение, культуру и окружающую среду, образование и инфраструктуру, консалтинговая группа опубликовала несколько интересных фактов.<br />\r\n	Вновь возглавляют список города Канады, а три канадских города вошли в первую пятерку. Бывший №1, Ванкувер, сохранил первое место, усилив свою позицию благодаря Олимпийским играм-2010, проведение которых укрепило позицию города по категориям: культура, окружающая среда и инфраструктура. Фактически весь топ-5 городов сохранился неизменным. Из городов США лучший &ndash; Питтсбург, стоящий на 29 месте в списке всех городов мира.<br />\r\n	1.Ванкувер, Канада<br />\r\n	2.Мельбурн, Австралия<br />\r\n	3.Вена, Австрия<br />\r\n	4.Торонто, Канада<br />\r\n	5.Калгари, Канада</p>\r\n', '2014-07-02 14:54:35', '2014-07-02 04:32:36', '<p>\r\n	Finding the best places to live takes a little research. Many companies and organizations have done a lot of the legwork for you, having compiled data and conducted surveys for that purpose.<br />\r\n	<br />\r\n	<strong>World&#39;s Best Places to Live</strong><br />\r\n	The London-based Economist Intelligence Unit&#39;s (EIU) Liveability Ranking, conducted a worldwide search for the best places to live and visit.<br />\r\n	<br />\r\n	Looking at 40 different indicators arranged in five separate categories, including stability, healthcare, culture and environment, education and infrastructure, EIU published some interesting findings. Once more, Canadian cities ranked high, with three cities in the top five. Former #1, Vancouver, retains its top spot, stregthening its position with the success of the 2010 Olympics, which bolstered the city&#39;s cultural, environmental and infrastructure areas. In fact, the top 5 cities remain unchanged. The best ranked US city is Pittsburgh, coming in at 29th in the World.<br />\r\n	1. Vancouver, Canada<br />\r\n	2. Melbourne, Australia<br />\r\n	3. Vienna, Austria<br />\r\n	4. Toronto, Canada<br />\r\n	5. Calgary, Canada</p>\r\n', 'Best Places to Live', 'Die besten Städte zum Leben', '<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	--></style>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">Um d</span><span lang="de-DE"><span style="font-style: normal">ie besten </span></span><em><span lang="de-DE"><span style="font-style: normal">St&auml;dte</span></span></em><span lang="de-DE"><span style="font-style: normal"> zum L</span></span><span lang="de-DE">eben zu finden, muss man eine kleine Forschung durchf&uuml;hren. Viele Unternehmen und Organisationen haben eine Menge von der Zuarbeit f&uuml;r Sie gemacht, als sie Daten zusammengestellt haben und Umfragen f&uuml;r diesen Zweck durchf&uuml;hrt haben.</span><br />\r\n	<br />\r\n	<span lang="de-DE"><b>D</b></span><span lang="de-DE"><span style="font-style: normal"><b>ie besten </b></span></span><em><span lang="de-DE"><span style="font-style: normal"><b>St&auml;dte der Welt</b></span></span></em><span lang="de-DE"><span style="font-style: normal"><b> zum L</b></span></span><span lang="de-DE"><b>eben</b></span><br />\r\n	<span lang="de-DE">Die Londoner Economist Intelligence Unit (EIU) hat eine weltweite Suche nach den besten Pl&auml;tzen zum Leben und zum Besuchen durchf&uuml;hrt.</span><br />\r\n	<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	-->	</style>\r\n</p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">Nach der Betrachtung von 40 verschiedenen Indikatoren</span><span lang="de-DE">, die in f&uuml;nf verschiedenen Kategorien angeordnet sind, einschlie&szlig;lich der Stabilit&auml;t, Gesundheitswesen, Kultur und Umwelt, Bildung und Infrastruktur, hat EIU einige interessante Erkenntnisse ver&ouml;ffentlicht. Noch einmal sind kanadische St&auml;dte auf der Liste oben, und drei St&auml;dte </span>geh&ouml;ren zur <span lang="de-DE"> Top-F&uuml;nf. Ehemalige Nr. 1, Vancouver, beh&auml;lt seinen Spitzenplatz, die Stadt hat ihre Position mit dem Erfolg der Olympischen Spiele-2010 verst&auml;rkt, die ihre Stelle in Kultur-, Umwelt- und Infrastruktur-Bereichen st&uuml;tzte. In der Tat bleiben die Top-5-St&auml;dte unver&auml;ndert. Die bestplatzierte Stadt von den USA ist Pittsburgh, sie kam am 29. Platz auf der Weltliste.</span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<style type="text/css">\r\n<!--\r\n		@page { margin: 0.79in }\r\n		P { margin-bottom: 0.08in; direction: ltr; color: #00000a; widows: 0; orphans: 0 }\r\n		P.western { font-family: "Times New Roman", serif; font-size: 12pt; so-language: en-US }\r\n		P.cjk { font-family: "Droid Sans Fallback"; font-size: 12pt; so-language: zh-CN }\r\n		P.ctl { font-family: "Lohit Hindi"; font-size: 12pt; so-language: hi-IN }\r\n		A:visited { so-language: en-US }\r\n		A:link { so-language: en-US }\r\n	-->	</style>\r\n</p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	<span lang="de-DE">1. Vancouver, Kanada<br />\r\n	2. Melbourne, Australien<br />\r\n	3. Wien, &Ouml;sterreich<br />\r\n	4. Toronto, Kanada<br />\r\n	5. Calgary, Kanada</span></p>\r\n<p class="western" lang="en-US" style="margin-bottom: 0in">\r\n	&nbsp;</p>\r\n', '<p>\r\n	Чтобы найти наилучшие для проживания города, требуется провести небольшое исследование. Cобрав все данные и проведя опросы c этой целью, многие компании и организации проделали за вас большую работу.</p>\r\n', '<p>\r\n	Finding the best places to live takes a little research. Many companies and organizations have done a lot of the legwork for you, having compiled data and conducted surveys for that purpose.</p>\r\n', '<p>\r\n	<span lang="de-DE">Um d</span><span lang="de-DE">ie besten&nbsp;</span><em><span lang="de-DE"><span style="font-style: normal;">St&auml;dte</span></span></em><span lang="de-DE">&nbsp;zum L</span><span lang="de-DE">eben zu finden, muss man eine kleine Forschung durchf&uuml;hren. Viele Unternehmen und Organisationen haben eine Menge von der Zuarbeit f&uuml;r Sie gemacht, als sie Daten zusammengestellt haben und Umfragen f&uuml;r diesen Zweck durchf&uuml;hrt haben.</span></p>\r\n'),
(15, 3, 'В качестве отделки для лестницы в одной из квартир Манхэттена использовали 20000 блоков Lego', '<p>\r\n	Обычно при поиске нового дома нужно учитывать такие вещи, как наличие встроенной посудомоечной машины или центрального кондиционирования. Однако одна из квартир на Манхэттене выделяется среди прочих своей необычностью &mdash; и это никак не связано с системами жизнеобеспечения. Лестницу в этом доме украшают красочные перила, полностью построенные из блоков Lego.</p><div align="center"><img src="http://architector.ua/images/articles/AlexA/pic_big/pic_1340266348.jpg" /><p>&nbsp;</p></div><p>Их дизайн разработан одним из официальных художников Lego в Нью-Йорке - да, такая профессия действительно существует - перила поднимаются на второй уровень квартиры. Их построили в основном из белых блоков, но&nbsp; выделяются они красочной отделкой на концах, включая большие открытые участки, придающие им очень абстрактный вид.<br />\r\n	Конечно, блоками Lego можно отделать дом по-своему, если достаточно времени и терпения. Тем не менее, мы бы не советовали полагаться на пластмассовые игрушечные блоки при создании вещей, на которые планируете ставить что-то тяжелое. Более того, неудачно споткнувшись на лестнице из Lego, вы можете превратить ее в огромную кучу разъединенных блоков и разбитые мечты.</p>\r\n', '2014-07-03 14:56:30', '2014-07-03 04:35:37', '<p>\r\n	Usually when you&#39;re looking for a new home, you need to consider things like whether or not it has a built-in dishwasher or central air conditioning. But one apartment in Manhattan has a rather unique feature that helps it stand out from the rest &mdash; and it has nothing to do with creature comforts. The main staircase in the home is adorned with a colorful railing constructed entirely of Lego blocks.</p><div align="center"><img src="http://architector.ua/images/articles/AlexA/pic_big/pic_1340266348.jpg" /><p>&nbsp;</p></div><p>Designed by one of New York&#39;s officially licensed Lego artists &mdash; yes, thats a real, actual profession &mdash; the railing extends from the main floor all the way to the second floor. It&#39;s been crafted using primarily white bricks, but features more colorful accents at both ends, including large open squares which give it a very abstract appearance.<br />\r\n	<br />\r\n	You can, of course, build your own Lego home accents, given enough time and patience. However, we&#39;d advise against relying on plastic toy blocks for anything you plan on putting a good amount of weight on. In fact, it would take just one unfortunate trip to turn the Lego staircase above into a massive pile of crushed blocks and broken dreams.</p>\r\n', 'Manhattan apartment features staircase lined with 20,000 Lego bricks', 'In Manhattan verfügt eine Wohnung über Treppe, deren Geländer aus 20.000 Legosteinen besteht.', '<p>Wenn Sie nach einem neuen Zuhause suchen, m&uuml;ssen Sie normalerweise einige Dinge beachten, ob es eine eingebaute Sp&uuml;lmaschine oder eine zentrale Klimaanlage gibt. Aber eine Wohnung hat in Manhattan eine ziemlich einzigartige Besonderheit, die sie von allen anderen unterscheidet - und sie hat keine Verbindung mit leibliches Wohl. Die Haupttreppe des Zuhauses wird mit einem bunten Gel&auml;nder geschm&uuml;ckt, das komplett aus Legosteinen gebaut ist.</p><div align="center"><img src="http://architector.ua/images/articles/AlexA/pic_big/pic_1340266348.jpg" /><p>&nbsp;</p></div><p>Das ist von einem offiziell lizenzierten in New York Lego-K&uuml;nstler entworfen - ja, der Beruf mit solchen Namen exisriert wirklich - das Gel&auml;nder erstreckt sich von der Hauptebene zu den zweiten Stock. H</span><font color="#000000">aupts&auml;chlich</font><span lang="de-DE"> ist es mit wei&szlig;en Steinen gebaut, sondern fallen mehr farbige Akzente an beiden Enden </span><font color="#000000"><span lang="de-DE">heraus</span></font><span lang="de-DE">, die gro&szlig;e offene Pl&auml;tze haben, die ihm ein sehr abstraktes Aussehen geben.<br />\r\n	Nat&uuml;rlich k&ouml;nnen Sie Ihre eigene Lego Akzente im Zuhause bilden, wenn Sie genug Zeit und Geduld haben. Allerdings w&uuml;rden wir nicht empfehlen, Kunststoff-Spielzeug-Bl&ouml;cke zu benutzen, wenn Sie Dinge erstellen, auf dennen etwas vom gro</span><span lang="de-DE">&szlig;</span><span lang="de-DE">en Gewicht gesetzt wird. In der Tat, es w&uuml;rde nur eine ungl&uuml;ckliche Reise um die Lego Treppe nach oben, und das </span><span lang="de-DE">Gel&auml;nder</span><span lang="de-DE"> zu einem massiven Haufen von getrennten Bl&ouml;cken und den zerbrochenen Tr&auml;umen wird.</span></p>\r\n', '<p>\r\n	Обычно при поиске нового дома нужно учитывать такие вещи, как наличие встроенной посудомоечной машины или центрального кондиционирования. Однако одна из квартир на Манхэттене выделяется среди прочих своей необычностью &mdash; и это никак не связано с системами жизнеобеспечения.</p>\r\n', '<p>\r\n	Usually when you&#39;re looking for a new home, you need to consider things like whether or not it has a built-in dishwasher or central air conditioning. But one apartment in Manhattan has a rather unique feature that helps it stand out from the rest &mdash; and it has nothing to do with creature comforts.</p>\r\n', '<p>\r\n	<span lang="de-DE">Wenn Sie nach einem neuen Zuhause suchen, m&uuml;ssen Sie normalerweise einige Dinge beachten, ob es eine eingebaute Sp&uuml;lmaschine oder eine zentrale Klimaanlage gibt. Aber eine Wohnung hat&nbsp;</span><span lang="de-DE">in Manhattan&nbsp;</span><span lang="de-DE">eine ziemlich einzigartige Besonderheit, die sie von allen anderen unterscheidet - und sie hat keine Verbindung mit leibliches Wohl.</span></p>\r\n');
