INSERT INTO `{dbPrefix}news_product` (`id`, `title`, `description`, `link`, `pubDate`, `author`, `is_show`, `lang`) VALUES
(1, 'Open Real Estate CMS gets a free English version!', '<p>Today a free ENGLISH version is released. It is 1.4 version of Open Real Estate CMS, based on Yii&nbsp; CMF.</p>\n<p>Nowadays over 300 websites use the Russian version of <a href="http://monoray.ru/products/6-open-real-estate">Open Real Estate CMS</a>.</p> \n<p><a href="http://monoray.net/products/6-open-real-estate">Read more</a> about a free English version of the product.</p>', 'http://monoray.net/83-open-real-estate/73-open-real-estate-cms-gets-a-free-english-version', '2012-09-20 11:52:32', 'MonoRay.ru', 1, 'en'),
(2, 'Вышла бесплатная английская версия Open Real Estate!', '<p>Сегодня мы выпустили бесплатную английскую версию CMS Open Real Estate 1.3.3 сделанную на основе CMF Yii.</p>\n<p>На данное время более 300 сайтов работают на русской версии <a href="http://monoray.ru/products/6-open-real-estate">Open Real Estate CMS</a>.</p>\n<p><a href="http://monoray.net/products/6-open-real-estate">Узнайте больше</a> о бесплатной английской версии продукта.</p>', 'http://monoray.ru/83-open-real-estate/73-vyshla-besplatnaya-anglijskaya-versiya-open-real-estate', '2012-09-20 11:55:22', 'MonoRay.ru', 1, 'ru'),
(3, 'Отключаем редирект в админку при просмотре объявления в ORE', '<p>Если мы зашли как администратор в Open Real Estate то при переходе на просмотр объявления, нас кидает в админку. Если Вам это не нравится, можно сделать так:</p>\n<p>в файле - /protected/modules/apartments/controllers/MainController.php</p>\n<p>удаляем или "закомменчиваем" такие строки -</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; // если админ - делаем редирект на просмотр в админку<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;if(Yii::app()-&gt;user-&gt;getState(''isAdmin'')){<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;$this-&gt;redirect(array(''backend/main/view'', ''id'' =&gt; $id));<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;}</p>', 'http://monoray.ru/83-open-real-estate/68-otklyuchaem-redirekt-v-adminku-pri-prosmotre-obyavleniya-v-ore', '2012-08-30 12:57:57', 'MonoRay.ru', 1, 'ru'),
(4, 'Отключаем скрол мышкой в картах ORE', '<p>При наведении мыши на карту в Open Real Estate, используя скрол, происходит масштабирование карты. Это не всегда удобно, и даже иногда раздражает, когда хочем проскролить страницу, а вместо этого меняется масштаб карты. Чтобы отключить срол мышкой в картах Google можно сделать следующие правки, в файле - /protected/modules/apartments/components/CustomGMap.php</p>\n<p>после строки</p>\n<p>$gMap = new EGMap();</p>\n<p>добавляем</p>\n<p>$gMap-&gt;setOptions(array(''scrollwheel'' =&gt; false));</p>\n<p>радуемся :)</p>\n<p>UPD.</p>\n<p>Чтобы убрать скрол мышков в Яндекс картах, в файле - /protected/modules/apartments/components/CustomYMap.php</p>\n<p>удалить строчку - map.enableScrollZoom();</p>', 'http://monoray.ru/83-open-real-estate/67-otklyuchaem-skrol-myshkoj-v-google-map', '2012-08-30 12:26:45', 'MonoRay.ru', 1, 'ru'),
(5, 'Обновление Open Real Estate до 1.3.2', '<p>Выпустили небольшое обновление. Были исправлены две неприятные ошибки:<br />1) некорректно работало восстановление пароля пользователя;&nbsp;<br />2) не удалялись фотографии из объявлений;<br />Новый архив можете скачать со <a href="http://monoray.ru/index.php?option=com_content&amp;view=article&amp;id=6:open-real-estate&amp;catid=80:products&amp;Itemid=496">страницы продукта</a>. Если необходимо обновить версию 1.3.1, то скачивайте <a href="http://static.monoray.ru/ORE_update_1.3.1_to_1.3.2.zip">архив</a> и заменяйте файлики из него (всего 2 файла).</p>', 'http://monoray.ru/83-open-real-estate/65-obnovlenie-open-real-estate-do-132', '2012-08-02 07:27:15', 'MonoRay.ru', 1, 'ru'),
(6, 'Обновление Open Real Estate до 1.3.1', '<p>Было исправлено несколько небольших ошибок. Самая неприятная - это <a href="http://monoray.ru/forum/viewtopic.php?f=3&amp;t=224">проблема с датой создания</a> объявления. В принципе, у кого продукт уже установлен - можете внесети исправления, как написано по ссылке. Все остальные могут скачать последнюю версию на <a href="http://monoray.ru/index.php?option=com_content&amp;view=article&amp;id=6:open-real-estate&amp;catid=80:products&amp;Itemid=496">странице продукта</a>.</p>', 'http://monoray.ru/83-open-real-estate/64-obnovlenie-openrealestate-do-131', '2012-07-17 07:02:24', 'MonoRay.ru', 1, 'ru'),
(7, 'Новая версия Open Real Estate 1.3.0', '<p>Выложили новую версию - бесплатную, русскоязычную. Список изменений и ссылка на скачивание доступна на <a href="http://monoray.ru/index.php?option=com_content&amp;view=article&amp;id=6:open-real-estate&amp;catid=80:products&amp;Itemid=496">странице продукта</a>.<br />Решается вопрос о создании скрипта, который позволит обновить версию с 1.2 на 1.3, но это пока под вопросом. После выходных станет известно точно, "быть или не быть".<br />В онлайн-демонстрации пока недоступны все платные модули, но через несколько дней добавим их, и можно будет увидеть, что из себя представляют платные услуги на сайте, рекламный модуль и другие.&nbsp;<br />На днях, дополнительно, планируем сделать онлайн-демо для мультиязычной и мультивалютной версии. Сейчас идет работа над переводами.</p>\n<p>Следите за новостями.&nbsp;</p>', 'http://monoray.ru/83-open-real-estate/63-novaya-versiya-open-real-estate-130', '2012-07-12 12:54:06', 'MonoRay.ru', 1, 'ru'),
(8, 'Русская версия Open Real Estate 1.3.0', '<p>Сегодня завершилась работа над русской версией <a href="http://monoray.ru/products/6-open-real-estate">CMS Open Real Estate</a> 1.3.0</p>\n<p>Пока обновили <a href="http://re.monoray.ru/">онлайн демо-версию</a>,&nbsp;чтобы вы могли ознакомиться с новшествами и изменениями. Желательно очистить кеш браузера, так как сайт может отображаться со старыми стилями.</p>\n<p>Архив для скачивания и полный список изменений будут чуть позже.</p>\n<p>P.S: Платная версия продукта с увеличенным функционалом также скоро выйдет в свет.</p>', 'http://monoray.ru/83-open-real-estate/62-russkaya-versiya-open-real-estate-130', '2012-07-11 10:39:36', 'MonoRay.ru', 1, 'ru'),
(9, 'Финишная прямая - версия ORE 1.3.0', '<p>Начали сборку и финальное тестирование новой версии продукта Open Real Estate. Сначала будет выпущена бесплатная версия для русского языка, примерно в это же время будет выложена на демонстрационный сайт БЕТА версия полной&nbsp;платной мультиязычной версии. Сама платная версия будет доступна после плотного тестирования.</p>', 'http://monoray.ru/83-open-real-estate/61-finishnaya-pryamaya-versiya-ore-130', '2012-07-09 12:51:13', 'MonoRay.ru', 1, 'ru'),
(10, 'Правки для SEO для ORE версии 1.2', '<p>Была обнаружена не совсем приятная вещь - дублирования контента (например, на главной странице). Что не очень благотворно сказывается на позиции сайтов в поисковых системах. Инструкция по исправлению доступна&nbsp;<a href="http://monoray.ru/forum/viewtopic.php?f=17&amp;t=203&amp;p=1086#p1086">здесь</a>. Всем клиентам, кто размещается на нашем сервере, ошибку исправил. Остальным рекомендую исправить вручную или обратиться за доработкой к нам через <a href="http://monoray.ru/index.php?option=com_flexicontact&amp;view=contact&amp;Itemid=544">форму контактов</a>.</p>', 'http://monoray.ru/83-open-real-estate/60-pravki-dlya-seo-dlya-ore-versii-12', '2012-07-09 12:42:33', 'MonoRay.ru', 1, 'ru'),
(11, 'Исправление работы Google Map в ORE 1.2.0', '<p>При тестировании добавления объявлений, нашел некритичный баг из за которого неправильно определяются координаты на карте и нужно вручную указывать местоположение объекта недвижимости. Также там не учитывались координаты по умолчанию и центрировало всегда на Москву.</p>\n', 'http://monoray.ru/83-open-real-estate/58-ispravlenie-raboty-google-map-v-ore-120', '2012-06-14 10:21:29', 'MonoRay.ru', 1, 'ru');
INSERT INTO `{dbPrefix}notifier` (`id`, `status`, `event`, `onlyAdmin`, `subject_ru`, `subject_en`, `subject_de`, `subject_admin_ru`, `subject_admin_en`, `subject_admin_de`, `body_ru`, `body_en`, `body_de`, `body_admin_ru`, `body_admin_en`, `body_admin_de`) VALUES
(1, 3, 'onNewBooking', 1, 'Новая заявка', 'New booking', 'Eine neue Buchung', 'Новая заявка', 'New booking', 'Eine neue Buchung', '<p>\r\n	Новая заявка.<br />\r\n	<br />\r\n	№ объявления: {apartment_id} (<a href="{fullhost}/property/{apartment_id}">{fullhost}/property/{apartment_id}</a>).<br />\r\n	Имя пользователя: {username}.<br />\r\n	Email: {useremail}.<br />\r\n	Телефон: {phone}.<br />\r\n	Дата заезда: {date_start}.<br />\r\n	Время заезда: {time_inVal}.<br />\r\n	Дата выезда: {date_end}.<br />\r\n	Время выезда: {time_outVal}.<br />\r\n	Комментарий: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />\r\n	<br />\r\n	Apartment ID: {apartment_id} (<a href="{fullhost}/property/{apartment_id}">{fullhost}/property/{apartment_id}</a>).<br />\r\n	Username: {username}.<br />\r\n	Email: {useremail}.<br />\r\n	Phone: {phone}.<br />\r\n	Date start: {date_start}.<br />\r\n	Times in: {time_inVal}.<br />\r\n	Date end: {date_end}.<br />\r\n	Time out: {time_outVal}.<br />\r\n	Comment: {comment}</p>\r\n', '<p>\r\n	Ein neuer Antrag auf Buchung (Objekt-ID {apartment_id}, <a href="{fullhost}/property/{apartment_id}">{fullhost}/property/{apartment_id}</a>).</p>\r\n<p>\r\n	Von {username} ({useremail}, Telefonnummer: {phone}),<br />\r\n	Anreise-Datum: {date_start},<br />\r\n	Anreise-Uhr: {time_inVal},<br />\r\n	Abreise-Datum: {date_end},<br />\r\n	Abreise-Uhr: {time_outVal}.<br />\r\n	Kommentar: {comment}</p>\r\n', '<p>\r\n	Новая заявка.<br />\r\n	<br />\r\n	№ объявления: {apartment_id} (<a href="{fullhost}/property/{apartment_id}">{fullhost}/property/{apartment_id}</a>).<br />\r\nEmail владельца объявления: {ownerEmail}<br /><br />\r\n	Имя пользователя: {username}.<br />\r\n	Email: {useremail}.<br />\r\n	Телефон: {phone}.<br />\r\n	Дата заезда: {date_start}.<br />\r\n	Время заезда: {time_inVal}.<br />\r\n	Дата выезда: {date_end}.<br />\r\n	Время выезда: {time_outVal}.<br />\r\n	Комментарий: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />\r\n	<br />\r\n	Apartment ID: {apartment_id} (<a href="{fullhost}/property/{apartment_id}">{fullhost}/property/{apartment_id}</a>).<br />\r\nEmail of the current owner of the listing: {ownerEmail}<br /><br />\r\n	Username: {username}.<br />\r\n	Email: {useremail}.<br />\r\n	Phone: {phone}.<br />\r\n	Date start: {date_start}.<br />\r\n	Times in: {time_inVal}.<br />\r\n	Date end: {date_end}.<br />\r\n	Time out: {time_outVal}.<br />\r\n	Comment: {comment}</p>\r\n', '<p>\r\n	Ein neuer Antrag auf Buchung (Objekt-ID {apartment_id}, <a href="{fullhost}/property/{apartment_id}">{fullhost}/property/{apartment_id}</a>).\r\nEmail of the current owner of the listing: {ownerEmail}<br /><br /></p>\r\n<p>\r\n	Von {username} ({useremail}, Telefonnummer: {phone}),<br />\r\n	Anreise-Datum: {date_start},<br />\r\n	Anreise-Uhr: {time_inVal},<br />\r\n	Abreise-Datum: {date_end},<br />\r\n	Abreise-Uhr: {time_outVal}.<br />\r\n	Kommentar: {comment}</p>\r\n'),
(3, 3, 'onNewUser', 0, 'Регистрация пользователя', 'User registration', 'Registration der Benutzer', 'Регистрация пользователя', 'User registration', 'Registration der Benutzer', '<p>\r\n	Добро пожаловать на {fullhost} !</p>\r\n<p>\r\n	Ваш логин: {email}<br />\r\n	Ваш пароль: {password}</p>\r\n<p>\r\n	Перед тем, как начать пользоваться сайтом<br />\r\n	Вы должны активировать свой аккаунт<br />\r\n	Ссылка на активацию аккаунта: {activateLink}</p>\r\n<p>\r\n	Вы можете зайти в личный кабинет через ссылку: {fullhost}/site/login</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '<p>\r\n	Welcome to {fullhost} !</p>\r\n<p>\r\n	Your login is: {email}<br />\r\n	Your password is: {password}</p>\r\n<p>\r\n	Before using the site<br />\r\n	You should activate your account<br />\r\n	Link for your account activation is {activateLink}</p>\r\n<p>\r\n	You can login to your control panel using the link: {fullhost}/site/login<br />\r\n	&nbsp;</p>\r\n', '<p>\r\n	Herzlich Willkommen bei {fullhost} !</p>\r\n<p>\r\n	Ihr Login: {email}<br />\r\n	Ihr Kennwort ist: {password}</p>\r\n<p>\r\n	Um die Website zu benutzen,<br />\r\n	Sie sollen Ihr Konto aktivieren<br />\r\n	Link zur Konto-Aktivierung: {activateLink}</p>\r\n<p>\r\n	Um sich in Ihr Konto einzuloggen, klicken Sie auf den folgenden Link: {fullhost}/site/login</p>\r\n', '<p>\r\n	Новый пользователь {username} {email} зарегистрирован.</p>\r\n<p>\r\n	Вы можете просматривать и управлять пользователями через ссылку: {fullhost}/users/backend/main/admin</p>\r\n', '<p>\r\n	New user {username} {email} has been registered.</p>\r\n<p>\r\n	You can view and manage users via: {fullhost}/users/backend/main/admin</p>\r\n', '<p>\r\n	Ein neuer Benutzer {username} {email} ist registriert.</p>\r\n<p>\r\n	Sehen Sie Benutzer und verwalten Sie sie via den Link: {fullhost}/users/backend/main/admin</p>\r\n'),
(4, 1, 'onNewContactform', 1, 'Новое сообщение (форма контактов)', 'New message (contact form)', 'Neue Meldung (Kontaktformular)', 'Новое сообщение (форма контактов)', 'New message (contact form)', 'Neue Meldung (Kontaktformular)', '', '', '', '<p>\r\n	Вам отправлено новое сообщение от {name} ({email}, {phone}).</p>\r\n<p>\r\n	Текст сообщения: {body}</p>\r\n', '<p>\r\n	New message is sent for you from {name} ({email}, {phone}).</p>\r\n<p>\r\n	Message text: {body}</p>\r\n', '<p>\r\n	Eine neue Meldung ist an Sie gesendet. Von: {name} ({email}, {phone}).</p>\r\n<p>\r\n	Text der Meldung: {body}</p>\r\n'),
(5, 1, 'onOfflinePayment', 1, 'Новый платеж через банк.', 'A new payment via a bank', 'Eine neue Zauhung über eine Bank', 'Новый платеж через банк.', 'A new payment via a bank', 'Eine neue Zauhung über eine Bank', '', '', '', '<p>\r\n	Новый платеж через банк на сумму {amount} {currency_charcode}</p>\r\n', '<p>\r\n	A new payment via a bank of the amount of {amount} {currency_charcode}</p>\r\n', '<p>\r\n	Eine neue Zauhung &uuml;ber eine Bankin in H&ouml;he von {amount} {currency_charcode}</p>\r\n'),
(6, 3, 'onRequestProperty', 0, 'Запрос к объявлению с сайта', 'Request for property from', 'Antrag auf Inserat von der Website', 'Запрос к объявлению с сайта', 'Request for property from', 'Antrag auf Inserat von der Website', '<p>\r\n	Здравствуйте, {ownerName}!<br />\r\n	<br />\r\n	Это письмо было отправлено через контактную форму на сайте {fullhost}<br />\r\n	От пользователя: {senderName}<br />\r\n	По поводу Вашего объявления {apartmentUrl}<br />\r\n	Email отправителя: {senderEmail}<br />\r\n	Сообщение: {body}</p>\r\n', '<p>\r\n	Hello, {ownerName}!</p>\r\n<p>\r\n	This message has been sent via a contact form on the site {fullhost}<br />\r\n	Sender: {senderName}<br />\r\n	About your listing {apartmentUrl}<br />\r\n	Sender email: {senderEmail}<br />\r\n	Sender phone number: {senderPhone}<br />\r\n	Message: {body}</p>\r\n', '<p>\r\n	Hallo {ownerName}!</p>\r\n<p>\r\n	Diese Meldung ist &uuml;ber ein Kontaktformular auf der Website gesendet {fullhost}<br />\r\n	Vom Benutzer: {senderName}<br />\r\n	&Uuml;ber Ihr Inserat: {apartmentUrl}<br />\r\n	E-Mail-Adresse des Absenders: {senderEmail}<br />\r\n	Meldung: {body}</p>', '<p>\r\n	Здравствуйте, администратор!<br />\r\n	<br />\r\n	Это письмо было отправлено через контактную форму на сайте {fullhost}<br />\r\n	От пользователя: {senderName}<br />\r\n	По поводу объявления: {apartmentUrl}<br />\r\n	Email отправителя: {senderEmail}<br />\r\n	Сообщение: {body}</p>\r\n<p>\r\n	Имя владельца: {ownerName}<br />\r\n	Email владельца: {ownerEmail}</p>', '<p>\r\n	Hello, administrator!</p>\r\n<p>\r\n	This message has been sent via a contact form on the site {fullhost}<br />\r\n	Sender: {senderName}<br />\r\n	About listing: {apartmentUrl}<br />\r\n	Sender email: {senderEmail}<br />\r\n	Sender phone number: {senderPhone}<br />\r\n	Message: {body}</p>\r\n<p>\r\n	Owner name: {ownerName}<br />\r\n	Owner email: {ownerEmail}\r\n</p>\r\n', '<p>\r\n	Hallo Administrator!</p>\r\n<p>\r\n	Diese Meldung ist &uuml;ber ein Kontaktformular auf der Website gesendet {fullhost}<br />\r\n	Vom Benutzer: {senderName}<br />\r\n	&Uuml;ber Inserat: {apartmentUrl}<br />\r\n	E-Mail-Adresse des Absenders: {senderEmail}<br />\r\n	Meldung: {body}</p>\r\n<p>\r\n	Name des Eigent&uuml;mers: {ownerName}<br />\r\n	E-Mail-Adresse des Eigent&uuml;mers: {ownerEmail}\r\n</p>\r\n'),
(7, 1, 'onNewComment', 1, 'Добавлен новый комментарий', 'A new comment is added', 'Ein neuer Kommentar ist hinzugefügt', 'Добавлен новый комментарий', 'A new comment is added', 'Ein neuer Kommentar ist hinzugefügt', '<p>\r\n	Добавлен новый комментарий к вашему объявлению {ad_url}. От: {user_name} ({user_email}), рейтинг: {rating}. Комментарий: {body}</p>', '<p>\r\n	New comment was added to your listing {ad_url}. From {user_name} ({user_email}), rating: {rating}. Message: {body}</p>\r\n', '<p>\r\n	Neuen Kommentar wurde auf Ihre Anzeige hinzugefügt {ad_url}. Von: {user_name} ({user_email}), Bewertung: {rating}. Kommentar: {body}</p>', '<p>\r\n	Добавлен новый комментарий. От: {user_name} ({user_email}), рейтинг: {rating}. Комментарий: {body}</p>\r\n', '<p>\r\n	New comment is added. From {user_name} ({user_email}), rating: {rating}. Message: {body}</p>\r\n', '<p>\r\n	Ein neuer Kommentar ist hinzugef&uuml;gt. Von: {user_name} ({user_email}), Bewertung: {rating}. Kommentar: {body}</p>\r\n'),
(8, 0, 'onNewApartment', 1, 'Добавлено новое объявление', 'New listing added', 'Ein neues Inserat ist hinzugefügt', 'Добавлено новое объявление', 'New listing added', 'Ein neues Inserat ist hinzugefügt', '', '', '', '<p>\r\n	Добавлено новое объявление ( ID объявления {id} ).</p>\r\n<p>\r\n	Вы можете посмотреть на {url}</p>\r\n', '<p>\r\n	New listing was added. ( Apartment ID {id} ).</p>\r\n<p>\r\n	You can view it at {url}</p>\r\n', '<p>\r\n	Ein neues Inserat ist hinzugef&uuml;gt (Objekt-ID {id} ).</p>\r\n<p>\r\n	Sie k&ouml;nnen besuchen {url}</p>\r\n'),
(9, 1, 'onNewComplain', 1, 'Добавлена новая жалоба', 'New complain added', 'Neue Beschwerde ist hinzugefügt', 'Добавлена новая жалоба', 'New complain added', 'Neue Beschwerde ist hinzugefügt', '', '', '', '<p>\r\n	Добавлена новая жалоба. От {name} ({email}).</p>\r\n<p>\r\n	Текст жалобы: {body}</p>\r\n', '<p>\r\n	New complain was added. From {name} ({email}).</p>\r\n<p>\r\n	Complain text: {body}</p>\r\n', '<p>\r\n	Neue Beschwerde ist hinzugef&uuml;gt. Von {name} ({email}).</p>\r\n<p>\r\n	Text von Beschwerde: {body}</p>\r\n'),
(11, 2, 'onRecoveryPassword', 0, 'Востановление пароля', 'Recover password', 'Kennwort Wiederherstellung', '', '', '', '<p>\r\n	Вы получили это письмо потому, что вы (либо кто-то, выдающий себя за вас) попросили выслать новый пароль к вашей учётной записи на сайте {fullhost}.</p>\r\n<p>\r\n	Новый пароль: {temprecoverpassword}</p>\r\n<p>\r\n	Прежде чем использовать новый пароль, вы должны его активировать. Для этого перейдите по ссылке: {recoverPasswordLink}</p>\r\n<p>\r\n	Вы можете зайти в личный кабинет через ссылку: {fullhost}</p>\r\n', '<p>\r\n	You&#39;ve got this mail because you (or someone, who was pretending to be you) asked to send new password to your account on the website {fullhost}.<br />\r\n	<br />\r\n	<br />\r\n	New password: {temprecoverpassword}<br />\r\n	<br />\r\n	Before using your new password, please activate it. Click the link: {recoverPasswordLink}<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	You can login to your personal account via this link: {fullhost}</p>\r\n', '<p>\r\n	Sie haben diese E-Mail erhalten, weil Sie (oder jemand, der sich&nbsp; f&uuml;r Euch auszugeben) gebeten, ein neues Passwort f&uuml;r Ihr Account auf der Website {fullhost} zu bekommen.<br />\r\n	<br />\r\n	Neues Passwort: {temprecoverpassword}<br />\r\n	<br />\r\n	Bevor Sie das neue Passwort benutzen werden, m&uuml;ssen Sie es aktivieren. Folgen Sie diesen Link: {recoverPasswordLink}<br />\r\n	<br />\r\n	<br />\r\n	Benutzen Sie den Link, um in Dashboard zu einloggen: {fullhost}</p>\r\n', '', '', ''),
(12, 1, 'onNewReview', 1, 'Был добавлен новый отзыв.', 'The new review was added.', 'Neue Referenz wurde hinzugefügt.', 'The new review was added.', 'Был добавлен новый отзыв.', 'Neue Referenz wurde hinzugefügt.', '', '', '', '<p>Был добавлен новый отзыв.</p> \r\n<p>От {name}.</p> \r\n<p>Сообщение: {body}</p>\r\n<p>Вы можете посмотреть на  {fullhost}/reviews/backend/main/admin</p>', '<p>The new review was added. </p> \r\n<p>From {name}. </p> \r\n<p>Body: {body}</p> \r\n<p>You can view it at {fullhost}/reviews/backend/main/admin</p>', '<p>Neue Referenz wurde hinzugefügt. </p> \r\n<p>Von {name}. </p> \r\n<p>Text von Referenz: {body}</p> \r\n<p>Sie können besuchen {fullhost}/reviews/backend/main/admin</p>'),
(13, 2, 'onNewAgent', 0, 'Новый агент', 'New agent', 'Neuer Agent', '', '', '', '<p>\r\n	Пользователь {username} ( email: {email}, телефон: {phone} ) указал, что является агентом Вашего агентства. Вы можете подтвердить или удалить пользователя в личном кабинете {fullhost}.</p>\r\n', '<p>\r\n	User {username} ( email: {email}, phone: {phone} ) identifies himself as an agent of your agency. You can confirm or delete this user in the dashboard {fullhost}.</p>\r\n', '<p>\r\n	Der Benutzer {username} ( email: {email}, phone: {phone} ) wies darauf hin, dass er den Agent Ihrer Agentur ist. Sie k&ouml;nnen das best&auml;tigen oder ihm im Dashboard l&ouml;schen {fullhost}.</p>\r\n', '', '', ''),
(14, 2, 'onNewPrivateMessage', 0, 'Новое личное сообщение', 'New message', 'neue Meldung', '', '', '', '<p>Здравствуйте, {username}.</p>\r\n<p>Вам пришло новое личное сообщение.</p>\r\n<div>Текст сообщения: {messageEmailSend}</div>\r\n<p>Чтобы ответить на данное сообщение войдите в свой аккаунт: {url}</p>\r\n', '<p>Hello {username}.</p>\r\n<p>You have got a new message.</p>\r\n<div>Message Text: {messageEmailSend}</div>\r\n<p>To answer it you need to access your account: {url}</p>', '<p>Hallo {username}.</p>\r\n<p>Sie bekommen eine neue Meldung.</p>\r\n<div>Meldungtext: {messageEmailSend}</div>\r\n<p>Um die Meldung zu antworten, loggen Sie bitte Ihren Account ein: {url}</p>', '', '', ''),
(15, 1, 'onNewSimpleBookingForRent', 1, 'Новая заявка (Оставить заявку)', 'New booking (Booking a property)', 'Eine neue Buchung (Immobilien buchen)', 'Новая заявка', 'New booking', 'Eine neue Buchung', '<p>\r\n	Новая заявка на бронь.<br />Имя пользователя: {username}.<br />Email: {useremail}.<br />Телефон: {phone}.<br />nТип: {type}.<br />Дата заезда: {date_start}.<br />Время заезда {time_inVal}.<br />Дата выезда:  {date_end}.<br />Время выезда {time_outVal}.<br />Комментарий: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Date start: {date_start}.<br />Times in {time_inVal}.<br />Date end:  {date_end}.<br />Time out {time_outVal}.<br />Comment: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Date start: {date_start}.<br />Times in {time_inVal}.<br />Date end:  {date_end}.<br />Time out {time_outVal}.<br />Comment: {comment}</p>\r\n', '<p>\r\n	Новая заявка на бронь.<br />Имя пользователя: {username}.<br />Email: {useremail}.<br />Телефон: {phone}.<br />nТип: {type}.<br />Дата заезда: {date_start}.<br />Время заезда {time_inVal}.<br />Дата выезда:  {date_end}.<br />Время выезда {time_outVal}.<br />Комментарий: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Date start: {date_start}.<br />Times in {time_inVal}.<br />Date end:  {date_end}.<br />Time out {time_outVal}.<br />Comment: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Date start: {date_start}.<br />Times in {time_inVal}.<br />Date end:  {date_end}.<br />Time out {time_outVal}.<br />Comment: {comment}</p>\r\n'),
(16, 1, 'onNewSimpleBookingForBuy', 1, 'Новая заявка (Оставить заявку)', 'New booking (Booking a property)', 'Eine neue Buchung (Immobilien buchen)', 'Новая заявка', 'New booking', 'Eine neue Buchung', '<p>\r\n	Новая заявка на бронь.<br />Имя пользователя: {username}.<br />Email: {useremail}.<br />Телефон: {phone}.<br />nТип: {type}.<br />Комментарий: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Comment: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Comment: {comment}</p>\r\n', '<p>\r\n	Новая заявка на бронь.<br />Имя пользователя: {username}.<br />Email: {useremail}.<br />Телефон: {phone}.<br />nТип: {type}.<br />Комментарий: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Comment: {comment}</p>\r\n', '<p>\r\n	A new booking has been created.<br />Username: {username}.<br />Email: {useremail}.<br />Phone: {phone}.<br />Type: {type}.<br />Comment: {comment}</p>\r\n');
