(2, 1, 2, 'Поднять в поиске', ' Put at the top of search results', '<p>\r\n	Объявление будет выделено желтым цветом и поднято в поиске.</p>\r\n', '<p>\r\n	<span class="hps">The announcement will be</span> <span class="hps">highlighted in yellow</span> <span class="hps">and raised</span> <span class="hps">in the search.</span></p>\r\n', '2013-01-04 12:12:37', 'Die Position in den Suchergebnissen nach oben verschieben', 'Das Inserat wird gelb markiert und in den Suchergebnissen nach oben verschoben.'),
