INSERT INTO `{dbPrefix}paysystem` (`id`, `active`, `name_ru`, `name_en`, `description_ru`, `description_en`, `model_name`, `settings`, `name_de`, `description_de`, `sorter`) VALUES
(1,	1,	'ROBOKASSA',	'ROBOKASSA',	'<p>\r\n	ROBOKASSA &mdash; это сервис, позволяющий Продавцам (интернет-магазинам, поставщикам услуг) принимать платежи от клиентовс помощью <a href=\"http://www.robokassa.ru/ru/Creditcards.aspx\">банковских карт</a>, в любой <a href=\"http://www.robokassa.ru/ru/Currencies.aspx\">электронной валюте</a>, с помощью сервисов <a href=\"http://www.robokassa.ru/ru/Sms.aspx\">мобильная коммерция</a> (МТС, Мегафон, Билайн), платежи через <a href=\"http://www.robokassa.ru/ru/E-invoicing.aspx\">интернет-банк</a> ведущих Банков РФ, платежи через банкоматы, через <a href=\"http://www.robokassa.ru/ru/Terminals.aspx\">терминалы мгновенной оплаты</a>, через систему денежных переводов <a href=\"http://www.contact-sys.com/\" target=\"_blank\">Contact</a>, а также с помощью <a href=\"http://www.robokassa.ru/ru/iRobokassa.aspx\">приложения для iPhone</a>. <span id=\"pastemarkerend\">&nbsp;</span></p>\r\n',	'<p>\r\n	ROBOKASSA &mdash; is the service, that allows sellers (on-line stores) to receive payments by <a href=\"http://www.robokassa.ru/en/Creditcards.aspx\">plastic cards</a>, in every <a href=\"http://www.robokassa.ru/en/Currencies.aspx\">e-currency</a>, using <a href=\"http://www.robokassa.ru/en/Sms.aspx\">mobile commerce</a> services (MTS, Megafon, Beeline), <a href=\"http://www.robokassa.ru/en/E-invoicing.aspx\">E-invoicing</a> via leading banks in Russia, through ATMs, through <a href=\"http://www.robokassa.ru/en/Terminals.aspx\">instant payment terminals</a>, through <a href=\"http://www.contact-sys.com/\" target=\"_blank\">Contact</a> remittances, and with the <a href=\"http://www.robokassa.ru/en/iRobokassa.aspx\">iPhone application</a>.<span id=\"pastemarkerend\">&nbsp;</span></p>\r\n',	'robokassa',	'{\"login\":\"koduc\",\"password1\":\"test1111\",\"password2\":\"test22223\",\"incCurrLabel\":\"QiwiR\",\"mode\":\"0\",\"text\":null,\"name\":null}',	'ROBOKASSA',	'<p>\r\n	ROBOKASSA ist ein Service, der alle Zahlungen mit Plastikkarten in jeder E-W&auml;hrung mit Mobile Commerce Services (MTS, Megafon, Beeline), durch Geldausgabeautomaten, durch Instant Zahlungs-Terminals, durch Kontakt &Uuml;berweisungen, mit der iPhone-Anwendung und E-Invoicing &uuml;ber f&uuml;hrende Banken Russlandsden den Verk&auml;ufer (Online-Shops) zu empfangen erm&ouml;glicht.</p>\r\n',	2),
(2,	1,	'Платеж через банк',	'Payment via a bank',	'<p>\r\n	Чтобы оплатить платную услугу Вы должны перечислить указанную выше сумму по следующим реквизитам:<br />\r\n	Расчетный счет: ________, БИК:_____, ОКАТО______ ...<br />\r\n	<br />\r\n	После того, как Вы отправите указанную сумму по данным реквизитам, нажмите кнопку &quot;Продолжить&quot;.<br />\r\n	Администратор получит уведомление о платеже и платная услуга будет активирована после получения денег.<span id=\"pastemarkerend\">&nbsp;</span></p>\r\n',	'<p>\r\n	To pay for the booking you need to transfer the amount above to the following banking details:<br />\r\n	________<br />\r\n	<br />\r\n	After you send that amount according to the banking details, click &quot;Continue&quot;.<br />\r\n	The administrator will be notified of the payment and will confirm the booking after receiving the money.</p>\r\n',	'offline',	'{\"name\":\"offline\"}',	'Zahlung über eine Bank',	'<p>\r\n	Um die Buchung zu zahlen m&uuml;ssen bitte &uuml;berweisen Sie den oben genannten Betrag an folgende Bankverbindung:<br />\r\n	Verrechnungskonto: ________, BIC: _____ OKATO______ ...<br />\r\n	<br />\r\n	Als Sie diesen Betrag nach den Bankdaten gesend haben, klicken Sie auf &quot;Weiter&quot;.<br />\r\n	Der Administrator wird von der Zahlung benachrichtigt sein und wird nach Eingang des Geldes die Buchung best&auml;tigen.</p>\r\n',	5),
(3,	1,	'PayPal',	'PayPal',	'\r\n<br>',	'',	'Paypal',	'{\"email\":null,\"mode\":\"0\",\"name\":null}',	'PayPal',	'\r\n<br>',	4),
(4,	1,	'Баланс',	'Balance',	'',	'',	'balance',	'{\"name\":\"balance\"}',	'Bilanz',	'',	1),
(5,	1,	'PayMaster',	'PayMaster',	'PayMaster — удобная онлайн-оплата на сайте.',	'PayMaster - convenient online payment online.',	'paymaster',	'{\"MERCHANT_ID\":\"test\",\"name\":null}',	'PayMaster',	'PayMaster- bequem online Zahlung online.',	3),
(6,	1,	'W1 «Единый кошелек»  оплата картами Visa/Master, терминалы пополнения',	'W1 «Wallet\" payment via Visa / Master, recharge terminals',	'',	'',	'W1',	'{\"merchant_id\":\"123123\",\"secret_key\":\"zxczxc\",\"mode\":\"0\",\"name\":null}',	'W1 «Wallet\" payment via Visa / Master, recharge terminals',	'',	6),
