INSERT INTO `{dbPrefix}seo_friendly_url` (`id`, `model_name`, `model_id`, `direct_url`, `url_ru`, `url_en`, `title_ru`, `title_en`, `description_ru`, `description_en`, `keywords_ru`, `keywords_en`, `url_de`, `title_de`, `description_de`, `keywords_de`) VALUES
(1, 'Apartment', 29, 0, '3-komn-kv-v-minutnoj-dostupnosti-do-mpaveleckaja', '2-bedroom-apartment-near-mpaveleckaja', '3 комн. кв. в минутной доступности до м.Павелецкая', '2-Bedroom Apartment within a minute walk from Paveletskaya metro station', 'В этой просторной и комфортабельной квартире Вы сможете насладиться видом на столицу нашей Родины и после удачного дня расслабиться в большой ванне', 'In this spacious and comfortable apartment you can enjoy the views of the capital of our country, and relax after a good day in a large bath.', '', '', '3-komn-kv-v-minutnoj-dostupnosti-do-mpaveleckaja', '3-Zimmer-Wohnung in einer Minute zu Fuß von der U-Bahn-Haltestelle Paveletskaya', 'In dieser geräumigen und komfortablen Wohnung können Sie den Ausblick auf die Hauptstadt unseres Landes genießen, und sich nach einem guten Tag in einer großen Badewanne entspannen.', ''),
(2,	'Apartment',	28,	0,	'1-komn-kv-metro-arbatskaja-bolshoj-afanasevskij-pereulok-10',	'apartment-near-arbatskaya-metro-station-bolshoy-afanasyevsky-lane-10',	'1 комн. кв. метро Арбатская, Большой Афанасьевский переулок 10',	'Apartment near Arbatskaya metro station, Bolshoy Afanasyevsky Lane, 10',	'В 7 минутной доступности от метро Арбатская',	'Within 7 minutes walk from Arbatskaya metro station',	'',	'',	'1-zimmer-wohnung-u-bahn-haltestelle-arbatskaya-bolschoi-afanasjevskij-pereulok-10',	'1-Zimmer-Wohnung, U-Bahn-Haltestelle Arbatskaya, Bolschoi Afanasjevskij Pereulok, 10',	'Die U-Bahn-Haltestelle Arbatskaja ist 7 Minuten entfernt',	''),
(3,	'Apartment',	27,	0,	'2-komn-kv-rjadom-s-m-prospekt-mira',	'1-bedroom-apartment-near-prospekt-mira-metro-station',	'2 комн. кв. рядом с м. Проспект Мира',	'1-Bedroom Apartment near Prospekt Mira metro station',	'Эта квартира вдохновит Вас на новые достижения. Здесь есть отдельная гостиная, в которой можно с комфортом встречать коллег или отдыхать с друзьями',	'This apartment will inspire you for new achievements. There is a separate living room, where you can comfortably meet colleagues or relax with friends.',	'',	'',	'2-zimmer-wohnung-in-der-naehe-von-der-u-bahn-haltestelle-prospekt-mira',	'2-Zimmer-Wohnung in der Nähe von der U-Bahn-Haltestelle Prospekt Mira',	'Diese Wohnung wird Sie für neue Erfolge inspirieren. Es gibt ein separates Wohnzimmer, wo Sie bequem mit Ihren Kollegen treffen und mit Freunden sich ausruhen können.',	''),
(4,	'Apartment',	26,	0,	'kvartira-ul-bolshaja-poljanka-d-28',	'apartment-bolshaya-polyanka-st-28',	'Квартира, ул. Большая Полянка, д. 28',	'Apartment, Bolshaya Polyanka St., 28',	'Комната с приятными оттенками синего и красивая ванная комната помогут Вам расслабиться после трудового дня',	'This apartment with nice shades of blue and a beautiful bathroom will help you to relax after work.',	'',	'',	'wohnung-bolschaja-poljanka-str-28',	'Wohnung, Bolschaja Poljanka Str., 28',	'Ein Zimmer mit feinen Schattierungen von Blau und ein schönes Badezimmer wird Ihnen helfen, sich nach der Arbeit zu entspannen.',	''),
(5,	'Apartment',	25,	0,	'odnokomnatnaja-kvartira-na-novom-arbate',	'apartment-on-novy-arbat-st',	'Однокомнатная квартира на Новом Арбате',	'Apartment on Novy Arbat St.',	'Уютная однокомнатная квартира в центре Москвы. Насладитесь прекрасным видом из окон высотки на улицы столицы нашей страны',	'A cosy apartment in the center of Moscow. Enjoy beautiful view of Russian capital.',	'',	'',	'1-zimmer-wohnung-in-der-novy-arbat-strasse',	'1-Zimmer-Wohnung in der Novy Arbat Straße',	'Eine gemütliche Wohnung im Zentrum von Moskau. Genießen Sie die schöne Aussicht auf russische Hauptstadt.',	''),
(6,	'Apartment',	24,	0,	'dacha-posutochno-v-badeevo',	'sountry-house-for-monthly-rent-in-badeevo-chekhov-moscow-oblast',	'Дача посуточно в Бадеево',	'Сountry house for monthly rent in Badeevo, Chekhov, Moscow Oblast',	'Дача посуточно в Бадеево',	'Сountry house for monthly rent in Badeevo, Chekhov, Moscow Oblast',	'',	'',	'landhaus-pro-tag-in-badeevo',	'Landhaus pro Tag in Badeevo',	'Landhaus pro Tag in Badeevo',	''),
(7,	'Apartment',	23,	0,	'dacha-v-pos-stolbovaja',	'sountry-house-in-stolbovaya-settlement',	'дача в пос. Столбовая',	'Сountry house in Stolbovaya settlement',	'дача в пос. Столбовая Чеховского района',	'Сountry house in Stolbovaya settlement, Chekhovsky Region',	'',	'',	'landhaus-in-der-siedlung-stolbovaja',	'Landhaus in der Siedlung Stolbovaja',	'Landhaus in der städtische Siedlung Stolbovaja, Tchekhowskji Region',	''),
(8,	'Apartment',	22,	0,	'dom-na-rublevskom-shosse',	'house-on-rublevskoe-highway',	'дом на Рублёвском шоссе',	'House on Rublevskoe highway',	'Сдаётся дом на Рублёвском шоссе, рядом с метро Крылатское',	'House for rent on Rublevskoe highway, near Krylatskoe metro station',	'',	'',	'haus-in-der-rublevskoe-fahrstrasse',	'Haus in der Rublevskoe Fahrstraße',	'Haus in der Rublevskoe Fahrstraße, in der Nähe der U-Bahn-Haltestelle  Krylatskoe',	''),
(9,	'Apartment',	21,	0,	'odnokomnatnaja-kvartira-pskovskaja-ulica',	'apartment-pskovskaya-st',	'Однокомнатная квартира Псковская улица',	'Apartment, Pskovskaya St.',	'Однокомнатная квартира на улице Псковская',	'Apartment on Pskovskaya St.',	'',	'',	'1-zimmer-wohnung-in-der-pskovskaja-strasse',	'1-Zimmer-Wohnung in der Pskovskaja Straße',	'1-Zimmer-Wohnung in der Pskovskaja Straße',	''),
(10,	'Apartment',	20,	0,	'chelobitevskoe-shosse',	'chelobitevskoe-highway',	'Челобитьевское шоссе',	'Chelobitevskoe highway',	'Дом на Челобитьевском шоссе',	'House on Chelobitevskoe Highway',	'',	'',	'tschelobitjevskoe-schosse',	'Tschelobitjevskoe Schosse',	'Haus in Tschelobitjevskoe Fahrstraße',	''),
(11,	'Apartment',	19,	0,	'dom-na-ul-trubeckaja',	'house-on-trubetskaya-st',	'дом на ул. Трубецкая ',	'House on Trubetskaya St.',	'Уютный дом на улице Трубецкая',	'A cosy house on Trubetskaya St.',	'',	'',	'haus-in-der-trubetskaja-strasse',	'Haus in der Trubetskaja Straße',	'Ein bequemes Haus in der Trubetskaja Straße',	''),
(12,	'Apartment',	18,	0,	'kvartira-na-ul-aviamotornaja',	'2-bedroom-apartment-aviamotornaya-st',	'квартира на ул. Авиамоторная',	'2-Bedroom Apartment, Aviamotornaya St.',	'2 комнатная квартира на улице Авиамоторная 22/12',	'2-Bedroom Apartment on Aviamotornaya St.',	'',	'',	'wohnung-in-der-aviamotornaja-strasse',	'Wohnung in der Aviamotornaja Straße',	'3-Zimmer-Wohnung in der Aviamotornaja Straße, 22/12',	''),
(13,	'News',	15,	0,	'v-kachestve-otdelki-dlja-lestnicy-v-odnoj-iz-kvartir-manhettena-ispolzovali-20000-blokov-lego',	'manhattan-apartment-features-staircase-lined-with-20000-lego-bricks',	'В качестве отделки для лестницы в одной из квартир Манхэттена использовали 20000 блоков Lego',	'Manhattan apartment features staircase lined with 20,000 Lego bricks',	'Обычно при поиске нового дома нужно учитывать такие вещи, как наличие встроенной посудомоечной машины или центрального кондиционирования. Однако одна из квартир на Манхэттене выделяется среди прочих своей необычностью &mdash; и это никак не связано с сист',	'Usually when you&#39;re looking for a new home, you need to consider things like whether or not it has a built-in dishwasher or central air conditioning. But one apartment in Manhattan has a rather unique feature that helps it stand out from the rest &mda',	'',	'',	'in-manhattan-verfuegt-eine-wohnung-ueber-treppe-deren-gelaender-aus-20000-legosteinen-besteht',	'In Manhattan verfügt eine Wohnung über Treppe, deren Geländer aus 20.000 Legosteinen besteht.',	'Wenn Sie nach einem neuen Zuhause suchen, m&uuml;ssen Sie normalerweise einige Dinge beachten, ob es eine eingebaute Sp&uuml;lmaschine oder eine zentrale Klimaanlage gibt. Aber eine Wohnung hat in Manhattan eine ziemlich einzigartige Besonderheit, die sie',	''),
(14,	'News',	14,	0,	'nauluchshie-dlja-prozhivanija-goroda',	'best-places-to-live',	'Наулучшие для проживания города',	'Best Places to Live',	'Чтобы найти наилучшие для проживания города, требуется провести небольшое исследование. Cобрав все данные и проведя опросы c этой целью, многие компании и организации проделали за вас большую работу .\r\n	\r\n	Наилучшие для проживания города мира\r\n	Находящаяс',	'Finding the best places to live takes a little research. Many companies and organizations have done a lot of the legwork for you, having compiled data and conducted surveys for that purpose.\r\n	\r\n	World&#39;s Best Places to Live\r\n	The London-based Economis',	'',	'',	'die-besten-staedte-zum-leben',	'Die besten Städte zum Leben',	'Um die besten St&auml;dte zum Leben zu finden, muss man eine kleine Forschung durchf&uuml;hren. Viele Unternehmen und Organisationen haben eine Menge von der Zuarbeit f&uuml;r Sie gemacht, als sie Daten zusammengestellt haben und Umfragen f&uuml;r diesen ',	''),
(15,	'News',	13,	0,	'kakie-veshchi-vo-vremja-pereezda-lomajutsja-chashche-vsego',	'which-items-often-get-broken-during-a-move',	'Какие вещи во время переезда ломаются чаще всего?',	'Which items often get broken during a move?',	'При переезде в новый дом или квартиру, имейте ввиду: некоторые вещи сделаны, чтобы сломаться. Когда дело доходит до переезда, нужно быть осторожным.\r\n\r\n	\r\n	Какие вещи чаще всего могут сломаться или разбиться при переезде?\r\n	#1 &ndash; Электронная техника\r',	'If you&#39;re moving to a new house or apartment, be advised: Some things are made to be broken.\r\n	When it comes to moving, you&#39;ve got to be careful.\r\n	Which items are among the most likely to get smashed and dashed at moving time?\r\n	#1 - Electronics\r',	'',	'',	'welche-gegenstaende-oft-bei-einem-umzug-kaputt-gehen',	'Welche Gegenstände oft bei einem Umzug kaputt gehen?',	'Wenn Sie in ein neues Haus oder eine Wohnung umziehen, wissen Sie: manche Dinge sind da, um gebrochen zu werden.\r\n	Wenn es um einen Umzug geht, m&uuml;ssen Sie vorsichtig sein.\r\n\r\n	\r\n	Welche Gegenst&auml;nde geh&ouml;ren zu denen, die oft bei Umz&uuml;ge ',	''),
(16,	'Menu',	12,	0,	'poisk-na-karte',	'search-on-map',	'Поиск на карте',	'Search on map',	'',	'',	'',	'',	'suche-auf-der-karte',	'Suche auf der Karte',	'',	''),
(17,	'Article',	5,	0,	'luchshie-goroda-dlja-holostjakov',	'best-places-for-singles',	'Лучшие города для холостяков',	'Best Places for Singles',	'Итак, Вы устали знакомиться на улицах и в барах своего города в попытках найти того или ту единственную, или может быть, у Вас было достаточно неудач на первых свиданиях, и поэтому Вас не заставишь выйти из дома в субботу вечером. Не отчаивайтесь. &quot;Ф',	'So you&#39;re tired of combing the streets and bars of your city in an attempt to find that special someone, or maybe you&#39;ve had enough bad first dates to keep you in on a Saturday night. Don&#39;t despair. The folks at Forbes&#39;s have compiled stat',	'',	'',	'die-besten-staedte-fuer-die-ledigen',	'Die besten Städte für die Ledigen',	'Also sind Sie m&uuml;de, die Stra&szlig;en und Bars Ihrer Stadt zu wechseln, um den einzigen oder die einzige zu finden, oder vielleicht haben Sie schon genug schlechte ersten Treffe, und also gehen Sie auf die Stra&szlig;e am Samstagabend niсht hinaus. V',	''),
(18,	'Article',	6,	0,	'nailuchshie-goroda-dlja-semi',	'best-places-for-families',	'Наилучшие города для семьи',	'Best Places for Families',	'Детский журнал провел обширное исследование среди 100 городов США в поисках лучших из них для того, чтобы растить детей. Учитывались такие факторы как, детское здравоохранение, школы, плата за жилье, качество воздуха.\r\n\r\n	1.Денвер, штат Колорадо\r\n	2.Норфо',	'Child magazine conducted an extensive search of 100 cities throughout the US to find the best place to raise a family. Factors ranged from pediatric healthcare, schools, housing costs and air quality.\r\n\r\n	1. Denver, Colorado\r\n	2. Norfolk/Virginia Beach/Ne',	'',	'',	'die-besten-staedte-fuer-familien',	'Die besten Städte für Familien',	'Eine Kinder-Zeitschrift f&uuml;hrte eine umfassende Suche nach 100 St&auml;dten in den USA durch, um die beste Stadt zur eine Familie-Gr&uuml;ndung zu finden. Es reichten solche Faktoren, wie p&auml;diatrische Gesundheitsversorgung, Schulen, Wohnkosten un',	''),
