(2, 1, 'Контактные данные на месяц', 'Contact information for one month', 'Kontaktinformationen für den Monat', '<p>Тариф создан для просмотра контактных данных владельцев объявлений на месяц.</p>\r\n', '<p>The tariff is created to view the contact information of the owners of the listings for one month.</p>\r\n', '<p>Der Tarif ist für die Anzeige der Kontaktinformationen auf der Anzeige Eigentümer Monat ausgelegt.</p>\r\n', 1, 3, 1, 1, 2, 30, '2015-04-10 06:07:14', '0000-00-00 00:00:00'),
(3, 1, 'Коммерческий доступ (10)', 'Commercially available (10)', 'Gewerbe-Zugang (10)', '<p>Тарифный план для тех, кто желает добавлять до 10 объявлений включительно.</p>\r\n', '<p>Tariff plan for those who want to add up to 10 listings inclusive.</p>', '<p>Tarif-Plan für diejenigen, die bis zu einschließlich 10 Anzeigen zu legen.</p>', 10, 10, 0, 0, 5, 30, '2015-04-10 06:08:23', '0000-00-00 00:00:00'),
(4, 1, 'Коммерческий доступ (50)', 'Commercially available (50)', 'Gewerbe-Zugang (50)', '<p>Тарифный план для тех, кто желает добавлять до 50 объявлений включительно.</p>\r\n', '<p>Tariff plan for those who want to add up to 50 listings inclusive.</p>\r\n', '<p>Tarif-Plan für diejenigen, die bis zu 50, einschließlich Anzeigen hinzufügen möchten.</p>\r\n', 50, 20, 0, 0, 10, 30, '2015-04-10 06:10:09', '0000-00-00 00:00:00');
