(954,	'module_paysystem',	0,	'offline_description',	'To pay for the booking you need to transfer the amount above to the following banking details:\r\nCurrent account: ________, BIC: _____ OKATO______ ...\r\n\r\nAfter you send that amount according to the banking details, click \"Continue\".\r\nThe administrator will be notified of the payment and will confirm the booking after receiving the money.',	'Чтобы оплатить бронь Вы должны перечислить указанную выше сумму по следующим реквизитам:\r\nРасчетный счет: ________, БИК:_____, ОКАТО______ ...\r\n\r\nПосле того, как Вы отправите указанную сумму по данным реквезитам, нажмите кнопку \"Продолжить\".\r\nАдминистратор получит уведомление о платеже и бронь будет потверждена после получения денег.',	'2013-02-28 00:36:12',	'Um die Buchung zu zahlen müssen Sie, bitte, den oben genannten Betrag an folgende Bankverbindung überweisen:\r\nVerrechnungskonto: ________, BIC: _____ OKATO______ ...\r\n\r\nAls Sie diesen Betrag nach den Bankdaten gesend haben, klicken Sie auf \"Weiter\".\r\nDer Administrator wird von der Zahlung benachrichtigt sein und wird nach Eingang des Geldes die Buchung bestätigen.'),
(955,	'module_paysystem',	0,	'robokassa_description',	'ROBOKASSA — is a service that allows sellers (on-line stores) to receive payments by plastic cards, in every e-currency, using mobile commerce services (MTS, Megafon, Beeline), E-invoicing via leading banks of Russia, through ATMs, through instant payment terminals, through Contact remittances, and with the iPhone application.',	'<p><span>ROBOKASSA — это сервис, позволяющий произвести оплату с помощью&nbsp;</span><a href=\"http://robokassa.ru/ru/Creditcards.aspx\">банковских карт</a><span>, в любой&nbsp;</span><a href=\"http://robokassa.ru/ru/Currencies.aspx\">электронной валюте</a><span>, с помощью сервисов&nbsp;</span><a href=\"http://robokassa.ru/ru/Sms.aspx\">мобильная коммерция</a><span>&nbsp;(МТС и Билайн), платежи через&nbsp;</span><a href=\"http://robokassa.ru/ru/E-invoicing.aspx\">интернет-банк</a><span>&nbsp;ведущих Банков РФ, платежи через банкоматы, через&nbsp;</span><a href=\"http://robokassa.ru/ru/Terminals.aspx\">терминалы мгновенной оплаты</a><span>, через систему денежных переводов&nbsp;</span><a href=\"http://www.contact-sys.com/\" target=\"_blank\">Contact</a><span>, а также с помощью&nbsp;</span><a href=\"http://robokassa.ru/ru/iRobokassa.aspx\">приложения для iPhone</a><span>.</span></p>',	'2013-02-28 00:36:12',	'ROBOKASSA - ist ein Service, der alle Zahlungen mit Plastikkarten in jeder E-Währung mit Mobile Commerce Services (MTS, Megafon, Beeline), durch Geldausgabeautomaten, durch Instant Zahlungs-Terminals, durch Kontakt Überweisungen, mit der iPhone-Anwendung und E-Invoicing über führende Banken Russlandsden den Verkäufer (Online-Shops) zu empfangen ermöglicht.'),
