(1183,	'module_seo',	0,	'help_seo_backend_main_admin',	'You should add an URL without a full site address (because it will be cut out in the code) and without the indication of a language prefix (en, ru) as well. In the beginning of the URL you should insert a back slash, for example \"/for news\" or \"/to news/12\", \"/to property/25\".',	'Добавлять URL нужно без полного адреса сайта (он всё равно вырезается в коде), без указания языкового префикса (en, ru), спереди обязательно должен быть обратный слеш, например \"/news\" или \"/news/12\", \"/property/25\".',	'2013-02-28 00:36:13',	'Sie sollen eine URL ohne eine vollständige Website-Adresse (weil sie in dem Code geschnitten wird) und ohne die Eingeben eines Sprache-Präfixes (en, ru) hinzufügen. In der Anfang der URL sollen Sie einen umgekehrten Schrägstrich, z.B. \"/ Nachrichten\" oder \"/Nachrichten/12\", \"/ Immobilie/25\" einlegen.'),
