(1526,	'module_iecsv',	0,	'Fields_import_export',	'Listing\'s type | Price\'s type | Property type | Price | City| Number of rooms | Floor | Total number of floors | Square | Number of berths | Listing title | Description | What is near? | Address | Bathroom | Security | Comfort | Kitchen | Work | Entertainment | Services | On conditions | Image | Latitude | Longitude',	'Тип объявления | Тип цены | Тип недвижимости | Город | Цена по требованию | Цена | Цена до | Количество комнат | Этаж | Всего этажей | Площадь | Количество спальных мест | Заголовок | Описание | Что рядом | Адрес | Ванная | Безопасность | Комфорт | Кухня | Работа | Развлечения | Услуги | Условия | Фото | Широта | Долгота',	'2013-05-26 06:21:08',	'Typ des Inserates | Typ des Preises | Objekttyp | Preis | Stadt | Anzahl der Zimmer | Stockwerk | Anzahl der Stockwerke | Fläche | Anzahl der Schlafplätze | Überschrift |Beschreibung | Was befindet sich in der Nähe? | Adresse | Badezimmer | Sicherheit | Komfort | Küche | Arbeit | Unterhaltung | Service | Bedingungen | Bild | Breitengrad | Längengrad'),
(1527,	'module_iecsv',	0,	'2 variants of listings export are available.',	'2 variants of listings export are available. The first variant exports the data into a .csv file and the photos are exported by inserting links to the photos into a csv file. The second one creates a .zip archive containing .csv file with listings info and photo names. Photos will be exported into the same archive. This variant allows getting a stand-alone copy of selected listings with photos. This, however, may take long to export listings using the second variant (the speed depends on the number of photos).',	'Возможны два варианта экспорта. В первом случае все данные экспортируются в csv файл, а фотографии экспортируются путем вставки в csv файл ссылки на эту фотографию. Во втором случае создается архив .zip, в котором хранится csv файл c информацией и названиями фотографий. Фотографии, в свою очередь, находятся в этом же архиве. Таким образом вы получаете автономный вариант ваших объявлений. Во втором случае процесс может занять значительный период времени в зависимости от числа фотографий.',	'2013-05-22 03:30:48',	'Für Export gibt es zwei mögliche Fälle. Im ersten Fall werden alle Daten in eine CSV-Datei exportiert, und die Bilder werden in dieser CSV-Datei durch Einfügen von Links zu diesen Bildern exportiert. Im zweiten Fall wird ein Zip-Archiv erstellt, in dem eine CSV-Datei mit Informationen und Namen von Bildern gespeichert wird. Dieses Archiv enthält auch die Bilder selbst. So erhalten Sie eine selbstständige Version von Ihren Inseraten. Im zweiten Fall kann das Verfahren viel Zeit nehmen, dies hängt von der Anzahl der Bilder ab.'),
(1528,	'module_iecsv',	0,	'You can populate your database importing a csv file with properties. You can also import listings with photos: create an archive of .zip structure described for ‘Export‘ operation.',	'You can populate your database importing a csv file with properties. You can also import listings with photos: create an archive of .zip structure described for ‘Export‘ operation.',	'Вы можете пополнить базу своих объявлений путем импорта из csv файла. Также вы можете импортировать объявления вместе с фотографиями, если создадите архив формата .zip структуры, описанной для операции экспорта.',	'2013-05-26 06:21:08',	'Sie können die Basis Ihrer Inserate durch den Import aus CSV-Datei ergänzen. Außerdem können Sie die  Inserate  mit Fotos importieren, wenn Sie ein Zip-Archiv gemäß der Struktur, die für den Export beschrieben ist, erstellen.'),
