(3025,	'common',	0,	'module_description_seo',	'This module offers you extended functions on search engine optimization of your website. Ability to set: url, meta title, meta keywords, meta description for listings, news, other website sections.',	'Данный модуль предоставляет расширенный функционал по поисковой оптимизации Вашего сайта. Возможность задавать: URL, метатег title, метатег keywords, метатег description для объявлений, новостей и других разделов сайта',	'2014-04-07 12:04:23',	'Dieser Modul bietet eine erweiterte Funktionalität der Suchmaschinenoptimierung Ihrer Website. Sie können solche Parameter einsetzen: URL, «Title» meta tag, «Keywords» meta tag, «Description» meta tag für Inserate, Nachrichten und andere Abteilungen der Website'),
