(3027,	'common',	0,	'module_description_sitemap',	'This module allows you to:<br/>\r\n- display links to all sections of your website within one page,<br/>\r\n- create xml-version for search robots',	'Этот модуль позволит:<br/>\r\n- отобразить ссылки на все разделы Вашего сайта в одном месте<br/>\r\n- создаст xml-версию специально для поисковых роботов',	'2014-04-07 11:06:02',	'Mit diesem Modul können Sie:<br/>\r\n- Links auf alle Abteilungen Ihrer Website in einem Ort wiedergeben<br/>\r\n- eine xml-Version speziell für Suchmaschinen herstellen'),
(3028, 'common', 0, 'module_name_socialposting', 'Module "Posting of listings to social networks"', 'Модуль "Передача объявлений в соц.сети"', '2015-05-18 11:29:20', '"Abgeben von Inseraten in sozialen Netzwerken" Modul'),
(3029,	'common',	0,	'module_description_socialposting',	'This module allows you to duplicate automatically all new listings to social networks.',	'Модуль позволяет в автоматическом режиме дублировать все новые объявления в различные соц.сети',	'2014-04-07 12:51:51',	'Dieser Modul bietet die Möglichkeit automatisch alle neue Inserate in verschiedenen sozialen Netzwerken zu duplizieren.'),
(3030, 'common', 0, 'module_name_iecsv', 'Module "Import / Export of listings"', 'Модуль "Импорт/экспорт объявлений"', '2015-05-18 11:30:10', '"IMPORT/EXPORT der Inserate" Modul'),
(3031,	'common',	0,	'module_description_iecsv',	'With the help of this module you will be able to:<br/>\r\n- load listings in the format of a csv file,<br/>\r\n- download listings in the format of a csv file.<br/>\r\nIt allows to:<br/>\r\n- interact with different realty databases,<br/>\r\n- make a backup copy of listings base.',	'Благодаря этому модулю вы сможете:<br/>\r\n- загружать объявления в csv-формате<br/>\r\n- выгружать объявления в csv-формате<br/>\r\nЭто позволит:<br/>\r\n- взаимодействовать с другими базами данных объектов недвижимости<br/>\r\n- делать резервные копии базы объявлений',	'2014-04-07 12:05:32',	'Mit diesem Modul können Sie:<br/>\r\n- Inserate in der csv-Format importieren<br/>\r\n- Inserate in der csv-Format exportieren<br/>\r\nDies wird:<br/>\r\n- mit anderen Datenbanken von Immobilien zu kommunizieren<br/>\r\n- Sicherungskopien der Datenbank zu anzeigen'),
(3032, 'common', 0, 'module_name_location', 'Module "Location"', 'Модуль "Местоположение"', '2015-05-18 11:31:33', 'Standortmodul'),
(3033,	'common',	0,	'module_description_location',	'It will let you specify not only the city where the property is, but its region and its country as well. Therefore, the search form will be changed according to it, so that the listings can be found easier and more quickly.',	'С этим модулем появится возможность указать не только город, в котором расположен объект, но и регион и страну. Соответствующим образом изменится и форма поиска, что позволит проще и быстрее искать объявления.',	'2014-04-07 11:48:51',	'Mit diesem Modul können Sie nicht nur die Stadt, in dem sich das Objekt befindet, sondern auch die Region und das Land zeigen. Entsprechend ändert sich Form der Suche.'),
