(3036, 'common', 0, 'module_name_yandexRealty', 'Module "Yandex.Realty"', 'Модуль "Яндекс.Недвижимость"', '2015-05-18 11:32:39', '"Yandex.Immobillen" Modul'),
(3037,	'common',	0,	'module_description_yandexRealty',	'This extension will allow you to transfer the listings from the site to one of the largest and frequently visited realty databases in Russia.',	'Данное расширение позволит передавать объявления с сайта в одну из самых больших и посещаемых баз данных недвижимости по России.',	'2014-04-07 12:06:02',	'Diese Erweiterung ermöglicht das Uebertragen der Inserate mit einer der größten und meistbesuchten Datenbanken von Immobilien in Russland.'),
(3038, 'common', 0, 'module_name_slider', 'Module "Slide-show management"', 'Модуль "Управление галереей"', '2015-05-18 11:33:25', 'Galerieverwaltungsmodul'),
(3039,	'common',	0,	'module_description_slider',	'It allows you to manage the slide-show on the home page with just a few clicks of your mouse. With the help of this module you can:<br/>\r\n- manage images from the admin panel,<br/>\r\n- set titles for images,<br/>\r\n- set links for images.',	'Модуль управления галереей на главной странице. Позволяет управлять галереей на главной странице сайта буквально парой щелчков \"мышкой\". Благодаря этому модулю Вы сможете:<br/>\r\n- управлять изображениями галереи из панели администратора<br/>\r\n- устанавливать заголовки для изображений<br/>\r\n- устанавливать ссылки для изображений',	'2014-04-07 11:15:57',	'Dieser Modul ermöglicht die Verwaltung der Galerie auf der Homepage buchstäblich mit ein paar Klicks. Mit diesem Modul können Sie:<br/>\r\n- Ihre Bilder aus Admin-Panel kontrollieren<br/>\r\n- Headerund Links für Bilder installieren'),
(3040, 'common', 0, 'module_name_advertising', 'Module "Advertising banners"', 'Модуль "Реклама"', '2015-05-18 11:34:05', 'Werbemodul'),
(3041,	'common',	0,	'module_description_advertising',	'This module allows you to place different banners on site pages. For every banner you can choose: setting a position, pages for its displaying.',	'С помощью этого модуля Вы сможете легко размещать на сайте рекламные блоки. Для каждого блока Вы можете выбрать: нужное положение и страницы для отображения',	'2014-04-07 11:00:53',	'Mit der Hilfe dieses Moduls können Sie Werbeblöcke einfach auf der Website einsetzen. Für jeden Block wählen Sie richtige Position, Seite für die Darstellung'),
(3042, 'common', 0, 'module_name_bookingcalendar', 'Module "Сalendar for booking a property"', 'Модуль "Календарь бронирования"', '2015-05-18 11:35:07', '"Buchungskalender" Modul'),
(3043,	'common',	0,	'module_description_bookingcalendar',	'It allows to:<br/>\r\n- mark the periods when the property is free or reserved,<br/>\r\n- display a calendar with visual information about it (free and reserved days are highlighted with different colors) on the listing\'s page.',	'Этот модуль позволяет:<br/>\r\n- указывать периоды свободного/сданного жилья<br/>\r\n- отображать на странице объявления календарь с наглядной информацией о доступности объекта',	'2014-04-07 11:21:05',	'Dieses Modul bietet die Möglichkeit:<br/>\r\n- die Perioden für frei/übergebene Gehäuse abzugeben<br/>\r\n- Kalender mit anschaulichen Informationen über die Verfügbarkeit des Objekts auf der Anzeigeseite einzusetzen'),
(3044, 'common', 0, 'module_name_formeditor', 'Module "The extended form editor"', 'Модуль "Расширенный редактор форм"', '2015-05-18 11:35:46', '"Erweiterte Formeditierer" Modul'),
(3045,	'common',	0,	'module_description_formeditor',	'With the help of it you will be able to:<br/>\r\n- add new fields,<br/>\r\n- edit fields,<br/>\r\n- add them into the search.',	'С этим модулем появится возможность:<br/>\r\n- добавлять новые поля<br/>\r\n- редактировать поля<br/>\r\n- добавлять новые поля в поиск',	'2014-04-07 11:56:20',	'Mit diesem Modul können Sie:<br/>\r\n- neue Felder hinzufügen<br/>\r\n- Felder bearbeiten<br/>\r\n- neue Felder in der Suche hinzufügen'),
